(13, 'CRP-2017 TATA CONSULTANCY SERVICES REGISTRATION', '<b>Dear Student,</b> </br>We are starting CRP registration for <b>Tata Consultancy Services ( TCS)</b> for 2017 Batch For enrolling yourself for TCS CRP follow steps given below :  <br>1. First fill College Registration form :<a href = \"https://goo.gl/forms/fdqFsSgabgl7MXxw1\">here</a> <b>Deadline</b> 11.30 AM 10 Sepetember 2016</br> 2. Fill online form available on <a href=\"https://nextstep.tcs.com/campus/\">here</a>  </br>Read instruction given in TCS Registration Process.pdf </br><b>NOTE :</b> 1. Both Registration are compulsory <b>deadline</b> 10th September 2016 11:30 AM</br> 2. Read PDF files carefully.</br> 3. PDF can be found at <a href=\"http://goo.gl/aPnD1j\">here</a> </br></br><b>CRITERIA:</b> All Branch 60% in 10th 12th or Diploma BE ( Aggregate )= or greater than 6.48 CGPI ( or = greater than 58%)</br> Live KT : Maximum 1</br> GAP : Maximum 2 years ( But not in between on any one course ...means in during BE drops not allowed )</br>Incase of any problem please email at <b>sakec.nilakshij@gmail.com</b><br><b>No calls will be entertained.</b>', '2016-09-09', '08:19:29', '4'),
