(23, 'test', 'Dear Student,\n\nWe are happy to share that Capgeminiâ€™s Tech Challenge 3.0 will be launched soon on September 16, 2016.\n\nCapgeminiâ€™s Tech Challenge 3.0 is an online Hackathon   Tech contest, targeted towards campus students, freshers, laterals and Capgemini employees. The contest is designed to identify the best developers and experts for a select list of topics. The gamified platform is designed to engage niche technology experts and also helps us identify the best talent.\n\nThere are two registration links.\n1. Placement portal registration (will be with this mail)\n2. http://techchallenge.in.capgemini.com/\n\n\n', '2016-09-14', '07:06:27', '5'),
