(25, 'Capgemini Tech Challenge 3.0', 'Dear Student,<br>\n\nWe are happy to share that Capgeminiâ€™s Tech Challenge 3.0 will be launched soon on September 16, 2016.<br>\n\n\nCapgeminiâ€™s Tech Challenge 3.0 is an online Hackathon   Tech contest, targeted towards campus students, freshers, laterals and Capgemini employees. The contest is designed to identify the best developers and experts for a select list of topics. The gamified platform is designed to engage niche technology experts and also helps us identify the best talent.<br>\n\nThere are two registration links:<br>\n1. Pre-register here http://techchallenge.in.capgemini.com/ <br>\n2. Placement Portal registration by clicking on link given below.\n\n\n', '2016-09-14', '07:13:33', '5'),
(26, 'Capgemini Tech Challenge 3.0', 'Dear Students, <br>\n\nWe are happy to share that Capgeminiâ€™s Tech Challenge 3.0 will be launched soon on September 16, 2016. <br>\n\n\n \n\nCapgeminiâ€™s Tech Challenge 3.0 is an online Hackathon   Tech contest, targeted towards campus students, freshers, laterals and Capgemini employees. The contest is designed to identify the best developers and experts for a select list of topics. The gamified platform is designed to engage niche technology experts and also helps us identify the best talent.<br>\n\nThere are two registration links. <br>\n1. Pre-register here http://techchallenge.in.capgemini.com/ <br>\n2. Placement Portal registration by clicking on link given below. <br>\n\nNote: Ignore the message if already received.\n\n ', '2016-09-14', '09:42:25', '5'),
(27, 'TCS CODEVITA CONTESTANTS WITH RANK BELOW 1500', '<b> THIS MESSAGE IS ONLY FOR STUDENTS WHO HAVE RANKED UNDER 1500 IN TCS CODEVITA ONLY. OTHERS KINDLY IGNORE THIS MESSAGE</b></br>\nAll the students who have ranked under 1500 in <b>TCS CODEVITA</b> and do not fulfil the eligiblity criteria are requested to SEND A MAIL for <b> TCS CRP 2017</b></BR>\nto <b>rushaabhsaliya@gmail.com</br>\n<b>SUBJECT SHOULD BE: TCS CODEVITA TOPPERS </B></br>\n<b> MAIL SHOULD CONTAIN :</BR> \n1> STUDENT NAME: </BR>\n2> TEAM NAME: </BR>\n3> TCS CODEVITA RANK:\n</BR>4> CLASS:</BR> \n5> DIVISION: </BR>\n6> ROLL NO. </BR>\n7> REGISTRATION ID:</BR> \n8> CT NUMBER: </BR> \n<b> DEADLINE IS 15th OF SEPTEMBER, 2016 8:00 AM. </b>\nIF you are RANKED BELOW 1500 RANK IN TCS CODEVITA AND HAVE ALREADY REGISTERED ONCE. PLEASE DO NOT SEND MAIL AGAIN. KINDLY IGNORE THIS MESSAGE.  \n</br>IF you are NOT BELOW 1500  RANK IN TCS CODEVITA , PLEASE DO NOT SEND MAIL. IF SOMEONE FOUND VIOLATING THE RULES. STRICT ACTION WILL BE TAKEN. \n</br>  REGISTER BEFORE 8:00 AM , 15th SEPT 2016. </b>\n</br> BOTH TEAM MEMBERS HAVE TO SEND MAIL individually. </b>', '2016-09-14', '12:51:36', ''),
