(59, 'lnt', '<p>Please Click below to Register for Larsen & Toubro  CRP . <b>Please read the instructions very Carefully :</b></br>\nFollowing are the  <b>ELIGIBLITY CRITERIA</b> for L&T: </br>\n<b>SSC HSC diploma: 60%</br>\nBE cgpi: 6.25</br>\nMaximum of 4 backlogs.</br>\n(Live+dead of both  Diploma+degree)</br>\nNo GAP No DROP</br>\nPLEASE MAKE SURE YOU CHECK THE NUMBER OF KTS. </br>\nIF YOU HAVE TOTAL KT\'S MORE THAN 4. (DIPLOMA+DEGREE) PLEASE  DO NOT REGISTER. </br>\nIF INELIGIBLE STUDENTS REGISTER. STRICT ACTION WILL BE TAKEN AGAINST THEM. </br>\nRECIEVING THIS MESSAGE DOESN\'T MEAN YOU ARE ELIGIBLE FOR THE COMPANY.PLEASE MAKE SURE YOU ARE ELIGIBLE. </p>\nFollowing are some IMPORTANT DOCUMENTS RELATED TO L&T. <a href=\"https://drive.google.com/drive/folders/0B8pIj-Jo9EiwX1JjWW53MzVMbEk?usp=sharing\">DOWNLOAD THEM HERE.</a>\n</b>', '2016-09-27', '14:32:43', ''),
