(61, 'LARSEN & TOUBRO CRP 2017 <B> REVISED ELIGIBILITY CRITERIA</B>', '<p>Please Click below to Register for Larsen & Toubro  CRP . <b>Please read the instructions very Carefully :</b></br>\n<b> ELIGIBILITY CRITERIA HAS BEEN REVISED.</br> PLEASE NOTE. EVEN IF YOU HAVE REGISTERED BEFORE , YOU HAVE REGISTER AGAIN<br>\nFollowing are the  <b>ELIGIBILITY CRITERIA</b> for L&T: </br>\n<b>SSC HSC diploma: 60%</br>\nBE cgpi: 6.25</br>\nMaximum of 4 backlogs.</br>\n(Live+dead of both  Diploma+degree)</br>\nNo GAP No DROP</br>\nNO DIPLOMA GAP ALLOWED.</br>\nPLEASE MAKE SURE YOU CHECK THE NUMBER OF KTS. </br>\nIF YOU HAVE TOTAL ATTEMPTS MORE THAN 2. (DIPLOMA+DEGREE) PLEASE  DO NOT REGISTER. </br>\nEVEN IF YOU HAVE KT IN 1 SUBJECT 2 TIMES. IT IS CONSIDERED AS 2 ATTEMPTS.\nDIPLOMA STUDENTS MUST COUNT THERE DIPLOMA KT\'S ALSO.\nIF INELIGIBLE STUDENTS REGISTER. STRICT ACTION WILL BE TAKEN AGAINST THEM. </br>\nRECEIVING THIS MESSAGE DOESN\'T MEAN YOU ARE ELIGIBLE FOR THE COMPANY.PLEASE MAKE SURE YOU ARE ELIGIBLE. </p>\nFollowing are some IMPORTANT DOCUMENTS RELATED TO L&T. <a href=\"https://drive.google.com/drive/folders/0B8pIj-Jo9EiwX1JjWW53MzVMbEk?usp=sharing\">DOWNLOAD THEM HERE.</a>\n</b>\n', '2016-09-28', '01:09:14', ''),
