(87, '<b>LARSEN ', '<p> <b> <u>All Eligible students are required take note of this information:</u></br>\n\n  CRP Date : 10th October 2016</br>\n2. Reporting Time : 08:00 AM </br>\n3. Schedule on 10th October 2016:</br>\nÂ·       Pre-placement Talk</br>\nÂ·       Online Aptitude   Technical Test</br>\nÂ·       Group Discussion- Case Study based</br>\nÂ·       Paragraph writing</br>\nÂ·       Technical Interview</br>\nÂ·       HR Interview</br></b></p>\n\n<p><b><u>Each round of assessment will be an elimination round.</u></b></br></p>\n<p><b><u>The candidates must carry :</u></b></br></p>\n<p>\n<ul>\n<li>Your college ID card</li>\n<li>Government valid photo ID card (Eg. Pan card, Aadhar card, Driving license, etc.)</li>\n<li>A copy of your Resume</li>\n<li>Attested photocopies of 10th mark sheet, 12th or Diploma mark sheets(All semesters), Graduation (all semesters) mark sheets and Post-graduation (all semesters) mark sheets including ATKT/Backlog/Arrears mark sheets(if any) along with relevant certificates.</br>Incase marks cards for the 6th semester results have not yet been provided to students, request them to carry a print out of the internet results or any other form of results available with them.</li>\n<li>2 passport size photograph.</li>\n<li>Duly filled on Trainee application form and eligibility/self-declaration form.<li>\n</ul>\n</p>', '2016-10-07', '04:41:33', ''),
(88, 'L', '<p> <b> <u>All Eligible students are required take note of this information:</u></br>\n\n  CRP Date : 10th October 2016</br>\n2. Reporting Time : 08:00 AM </br>\n3. Schedule on 10th October 2016:</br>\nÂ·       Pre-placement Talk</br>\nÂ·       Online Aptitude   Technical Test</br>\nÂ·       Group Discussion- Case Study based</br>\nÂ·       Paragraph writing</br>\nÂ·       Technical Interview</br>\nÂ·       HR Interview</br></b></p>\n\n<p><b><u>Each round of assessment will be an elimination round.</u></b></br></p>\n<p><b><u>The candidates must carry :</u></b></br></p>\n<p>\n<ul>\n<li>Your college ID card</li>\n<li>Government valid photo ID card (Eg. Pan card, Aadhar card, Driving license, etc.)</li>\n<li>A copy of your Resume</li>\n<li>Attested photocopies of 10th mark sheet, 12th or Diploma mark sheets(All semesters), Graduation (all semesters) mark sheets and Post-graduation (all semesters) mark sheets including ATKT/Backlog/Arrears mark sheets(if any) along with relevant certificates.</br>Incase marks cards for the 6th semester results have not yet been provided to students, request them to carry a print out of the internet results or any other form of results available with them.</li>\n<li>2 passport size photograph.</li>\n<li>Duly filled on Trainee application form and eligibility/self-declaration form.<li>\n</ul>\n</p>', '2016-10-07', '04:43:13', ''),
(89, 'LARSEN & TOUBRO CRP UPDATE!', '<p> <b> <u>All Eligible students are required take note of this information:</u></br>\n\n  CRP Date : 10th October 2016</br>\n2. Reporting Time : 08:00 AM </br>\n3. Schedule on 10th October 2016:</br>\nÂ·       Pre-placement Talk</br>\nÂ·       Online Aptitude   Technical Test</br>\nÂ·       Group Discussion- Case Study based</br>\nÂ·       Paragraph writing</br>\nÂ·       Technical Interview</br>\nÂ·       HR Interview</br></b></p>\n\n<p><b><u>Each round of assessment will be an elimination round.</u></b></br></p>\n<p><b><u>The candidates must carry :</u></b></br></p>\n<p>\n<ul>\n<li>Your college ID card</li>\n<li>Government valid photo ID card (Eg. Pan card, Aadhar card, Driving license, etc.)</li>\n<li>A copy of your Resume</li>\n<li>Attested photocopies of 10th mark sheet, 12th or Diploma mark sheets(All semesters), Graduation (all semesters) mark sheets and Post-graduation (all semesters) mark sheets including ATKT/Backlog/Arrears mark sheets(if any) along with relevant certificates.</br>Incase marks cards for the 6th semester results have not yet been provided to students, request them to carry a print out of the internet results or any other form of results available with them.</li>\n<li>2 passport size photograph.</li>\n<li>Duly filled on Trainee application form and eligibility/self-declaration form.<li>\n</ul>\n</p>\n<p><b>  STUDENTS WHO ARE ALREADY SELECTED FOR TCS. KINDLY IGNORE THIS MESSAGE</b></p>', '2016-10-07', '04:48:21', ''),
(90, 'VOLUNTEERING FOR L&T CRP ', '<p><b>All the students who have  been selected in TCS, HAVE COMPULSORILY VOLUNTEER DURING L&T CRP </b></br>\n<b>DATE:10th October 2016</br>\nREPORTING TIME : 8:00 AM</br>\n</b> \n<b> You all will not allowed to sit for L&T CRP</b>\n</p>', '2016-10-07', '04:58:26', ''),
