(93, 'L&T CRP UPDATE!', 'Hi,</br>\n<b>\nAs you failed to register on revised criteria link of LnT Infotech. Your details have not been shared with them.</br>\n\nPlacement team will request the LnT people tomorrow to allow you for the process.\nIf they agree then you will be allowed to sit.\n</br>\nSo, you have to report in the morning tomorrow as per given schedule to others and meet Placement Team to register your name for the process.</br>\n\nThis mail doesn\'t guarantee that you can appear for the process. The final decision will be taken by LnT team only.</br>\nThis applies only if you are Eligible for L&T</b>', '2016-10-09', '06:16:14', ''),
(94, 'MEDIA.NET CRP UPDATE!', 'Dear Students</br>\n \n \nThe CRP of Media.net is on<b> 11th Oct. 2016 ( Tuesday)</b></br>\n \nThe Schedule of the day:</br>\n \npre placement talk followed by the online coding test</br>\n \nReporting Time: 10:00 a.m at 7th Floor Audi.</br>\n \nThe Shortlisted students will be having Interview 0n 12 th October 2016 at Media.net office.</br>\n \nRegards,</br>\nPlacement Team\nSAKEC', '2016-10-10', '07:00:28', ''),
