(109, 'VISTAAR CRP REGISTRATION', '\n<b>Dear Students, </b></br>\nRegistrations for<b> Vistaar</b> have started. </br>\nFollowing are the Eligibility Criteria :</br> \nBranches = B.E/ B.Tech – Computer Engineering and Information Technology.</br>\nNO LIVE KT</br>\nNO DROP</br>\nNO PERCENTAGE CRITERIA</br>\n\nLast Date of Registration : 12th OCT 2016</br>\nLATE ENTRIES WON\'T BE ENTERTAINED</br>\n\nDate of CRP : 17th OCT 2016</br>', '2016-10-11', '12:13:53', '13'),
