(111, 'VISTAAR CRP UPDATE ', 'Hi.</br>\nThis is the Mail for Vistaar registered Students regarding CRP update.</br>\nReporting time: <b>10:00 AM</b></br>\nVenue: 7th floor Audi</br>\n\nSelection Process:</br>\nStep 1: Pre-Placement talk and Aptitude test (Venue : SAKEC campus)</br>\nStep 2: The students who clear the aptitude test will sit for personal round  of technical interviews (Venue : Vistaar Office)</br>\nStep 3: Release of Offer Letter. This will happen on the same day of Personal Interviews. (Venue : Vistaar Office) </br>\n<b>NOTE: MAKE SURE YOU HAVE YOUR PLACEMENT KIT WITH YOU. </b></br>\n<b>ALL THE BEST.</b>', '2016-10-15', '04:46:26', ''),
