(126, 'Vistex Registeration', '<b>Register for Vistex</br>\r\n<b> VISTEX CRP ON <u>4TH JAN 2017</u></b></br>\r\nCriteria for  Vistex:</br>\r\nIT & COMPUTERS ONLY</br>\r\nCGPI : = > 6.06 </br>\r\nLive KT: Max 1 Allowed </br>\r\nDead  KT : No Criteria</br>\r\nLast date for registration is till <u>23rd December 12:00 AM midnight</u></br>\r\nThere will a written aptitude test on the same day. Reporting time is <u>11:00 AM</u> 7th floor Auditorium.</b>', '2016-12-21', '08:36:50', '16'),
(127, 'Notice for defaulters regarding Vistex', '<b>Vistex CRP will be conducted on 4th of January 2017</b></br>\r\n<b> All the people who receive this notice are defaulters.  SO THIS MAIL DOES NOT GUARANTEE THAT YOU WILL BE ALLOWED TO SIT FOR PLACEMENT.</br>\r\nAll the defaulters will be reviewed by the placement committee and they will take the final decision. whether a student will be allowed to attend placement or not. </b>  \r\n  ', '2016-12-22', '09:17:26', ''),
(131, 'Zeus learning', '<b>ZEUS_LEARNING REGISTRATION<b></br>\r\n<b>criteria:-</br>\r\nCGPA 5.5 & above</br>\r\nNo kt criteria</br>\r\nDrop allowed</br>\r\nKindly register on two links</br>\r\n1. ZEUS registration </br>\r\n<a href=\"https://docs.google.com/forms/d/e/1FAIpQLSfJvNsBNS7IApleYssLpUR3SkfYOczWCYPj-PalVf8FefBXGQ/viewform\">click for ZEUS registration </a></br>\r\n2. college registartion</br>\r\njust click on below click here to register .</br>\r\nLAST DATE OF REGISTRATION IS 3rd  JANUARY TILL 12:00 AM MIDNIGHT.</b>', '2017-01-01', '00:52:57', '17'),
(133, 'ZEUS REMINDER', '<b>All the eligible students for ZEUS_LEARNING are hereby informed to report on time as per their day and slot, whether they have got confirmation mail or not. As they have system problem due to which some students are not receiving their confirmation mail.</br></br>\nRegards,\nPlacement Team.</b>', '2017-01-04', '08:46:59', ''),
(134, 'DEFAULTERS REMINDER', '<b> IMPORTANT NOTICE</br>\nALL THE DEFAULTER STUDENTS ARE HEREBY INFORMED THAT THEIR IS A MEETING ON <u> SATURDAY 7TH JAN 2017 SHARP AT 11:AM , 4TH FLOOR ROOM NO 42.</u></br>\nIT IS COMPULSORY TO ATTEND THE MEETING IF THEY WANT TO SIT FOR THE FURTHER PLACEMENT.</br>\nNOTE</br>\nTHIS WILL BE THE LAST CONSIDERATION.</br>\nIF STUDENTS FAIL TO ATTEND THE MEETING, THEY WILL BE MARKED AS DEFAULTER ONLY AND WILL NOT BE ALLOWED IN ANY CONDITION FOR FURTHER PLACEMENT.</b>', '2017-01-04', '08:59:11', ''),
(141, 'MEDIA.NET REGISTRATION', '<b>Media.net is again going to visit our campus on 11th Jan 2017 for campus recruitment Program ( Non Dream ) for your batch.</br></br>\r\n \r\nPost offered :  Campaign Manager</br></br>\r\n \r\nSelection Rounds : Total 3 round ( Written Aptitude Test ( Logical and Reasoning)  , Panel Interview 1 and Panel Interview 2 )</br></br>\r\n \r\nSalary : 22,000 per month (gross)</br></br>\r\n \r\nCriteria - 5.0 CGPI to 7.0 CGPI  ( All Branch )</br></br>\r\n \r\nRead the PDF attached with the mail for post details and start doing preparation for the same.</br></br>\r\n\r\nOnly registered student will be allowed to sit for the CRP.</br></br>\r\n \r\nNote : Do not call any Placement Team Member for any query strictly send them mail if urgent  .</br></br>\r\n \r\nLast date to register is 9th January till 12:00 AM midnight</br></br>\r\n\r\nCLICK BELOW FOR REGISTRATION</br></br>\r\n\r\nPlacement Team</b>', '2017-01-07', '12:40:41', '18'),
(142, 'NUCSOFT REGISTRATION', '<b>Nucsoft is going to visit our campus next week .find complete details in the attachments.</br></br>\r\n \r\nCompany Name : Nucsoft</br></br>\r\n \r\nCriteria : Aggregate 5.0 CGPI ( Only Computer and IT branch )</br></br>\r\n\r\nNon dream company</br></br>\r\n \r\nPackage Details check in attachment.</br></br>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B_dZONtzzr7ZRmJ1aWlmd0RCSkE\"> <u>please find the attachment here</u></a></br></br>\r\n\r\nlast date of registration is 9 January till 12:00 AM midnight</br></br>\r\n\r\nPlease click below to register.</br></br>\r\n\r\nThanks,</br></br>\r\n\r\nPlacement Team.</b>\r\n', '2017-01-07', '12:44:36', '19'),
(143, 'MEDIA.NET REPORTING TIME', '<b> ALL THE REGISTERED STUDENTS FOR MEDIA.NET HAS TO REPORT SHARP  TOMORROW <u>11TH  JANUARY 2017  AT  9:15 AM  7TH FLOOR AUDITORIUM</u> IN FULL FORMALS.</b> </br>\r\n<b>PLACEMENT TEAM</b>', '2017-01-10', '00:30:27', ''),
(145, 'Jio Registeration', '<b>RELIANCE_JIO  is going to visit our campus.</br></br>\n \nCompany Name : RELIANCE_JIO</br></br>\n \nCriteria : 10th & 12th Aggregate 60%</br></br>\n\ndegree cgpi aggregate 6.76</br></br>\n\ndrops not allowed.</br></br>\n\nkt\'s allowed.</br></br>\n\nOnly COMPUTER,IT & EXTC branch.</br></br>\n\nNon dream company.</br></br>\n\nlast date of registration is 13 January till 12:00 AM midnight.</br></br>\n\nPlease click below to register.</br></br>\n\nThanks,</br></br>\n\nPlacement Team.</b>', '2017-01-12', '02:11:00', '21'),
(146, ' ACTION-OUT OF CRP', '<b>DUE TO YOUR FAILURE TO ATTEND MEDIA.NET CRP ON 11TH JANUARY 2017, YOU WILL NOT BE ALLOWED TO SIT FOR THE FURTHER PLACEMENT ACTIVITY</br></br></br>\r\nThanks,</br>\r\nPlacemnt Team</b>', '2017-01-12', '06:23:42', ''),
(148, 'ZEUS REGISTERED STUDENTS', '<b>ALL  THE ZEUS REGISTERED STUDENTS WHO HAVE BEEN SHORTLISTED FOR ROUND 2 HAVE TO GIVE THE FOLLOWING DETAILS</br></br>\r\nREG_ID NO</br></br>\r\nBRANCH</br></br>\r\nDATE AND SLOT FOR ZEUS INTERVIEW</br></br>\r\nSEND THE MAIL TO Placement@shahandanchor.com</br></br>\r\nTHANKS,</br></br>\r\nPLACEMENT TEAM.</b>', '2017-01-12', '07:54:16', ''),
(152, 'Reliance Jio', '<b>RELIANCE_JIO  is going to visit our campus.</br></br> Company Name : RELIANCE_JIO</br></br> Criteria : 10th & 12th Aggregate 60%</br></br> degree cgpi aggregate 6.76</br></br> drops not allowed</br></br> kt\'s allowed</br></br> Only electronics branch</br></br> Non dream company</br></br> last date of registration is 20 January till 12:00 pm noon</br></br> Please click below to register.</br></br> Thanks,</br></br>  Placement Team.</b>', '2017-01-19', '09:38:03', '22'),
