(156, 'SoGoSurvey pool campus', 'Pool Campus Placement Drive for SoGoSurvey - 2017 Batch at PVPPCOE.</br>\r\nâ€‹Aâ€‹ll the eligible and interested students need to apply for this  Pool Campus Drive on\r\n<a href=\"http://pvppcoe.ac.in/placement-notice\">click here</a> as well as on our college link.</br>\r\nand this is mandatory.Deadline to apply 25th Jan 2017 11.00PM.â€‹</br>\r\n \r\nSoGoSurvey Pool Campus Placement Drive 2017 Batch at PVPPCOE on 1st Feb 2017.</br>\r\n\r\nJob title: Trainee Technical Analyst (Asp.net programmer/ QA(Software Testing))</br>\r\nLocation: Bandra Mumbai</br>\r\nDate of Joining:  Tentatively July 2017.</br>\r\n\r\nRequirements / Eligibility:- </br> \r\n1. 10th (80% and above) and 12th above 70% marks.</br>\r\n2. Bachelors degree(B.E or B.Tech in IT, Computers or Electronics & Telecommunication , Electronics)</br>\r\n3. Very good written and verbal communication skills in English</br>\r\n4. Aptitude for Math and problem solving skills</br>\r\n5. Original Thinking and Creativity</br>\r\n6. Independent Attitude</br>\r\n7. Willingness to sign a retention agreement of 2.5 years</br>\r\n8. Ready to relocate to Mumbai</br> \r\nCTC:- 3.0 LPA plus</br> \r\n\r\nCampus Date: 1st Feb 2017</br>\r\nCampus Venue:- PVPPCOE</br>\r\nVasantdada Patil Education Complex,</br>\r\nEastern Express Highway,</br> \r\nSion - Chunabatti, Near Everard Nagar,</br> \r\nMumbai, Maharashtra 400022.</br>', '2017-01-25', '02:24:40', '23'),
(157, 'Interface Design Associates Pvt. Ltd.', 'students from ECE or EE departments, </br>10th - 60%</br>12th - 60%</br>Who have done their project with embedded programming on uCs, DSPs or FPGAs.</br> They must have demonstrable skills with the respective tool chains and programming.</br> Skills in PCB design ( schematic capture and layout ), any projects in motor control area, would be a plus.</br>', '2017-01-28', '04:47:50', '24');
