(160, 'important notice for interface designs', 'All the interface designs registered students  have to send their resumes in PDF format at placement@shahandanchor.com</br>\nthey have to highlights the given points in their resume who have done their project with embedded programming on uCs, DSPs or FPGAs from semester 6 to final semester.</br>\nkindly fill the below given form. <a href=\"https://goo.gl/forms/9jyE6vFpDoNrq6U43\">click here</a></br>\ndeadline to send the resume is till 10 pm today.', '2017-01-30', '07:14:37', ''),
(161, 'Prototech solutions and services', 'Pool campus placement Drive for ProtoTech solutions 2017 batch at PVPPCOE</br>\nAll the eligible and interested students need to apply for this pool campus drive on <a href=\"http://pvppcoe.ac.in/placement-notice\"><b> click here</b></a>and also on sakec portal</br>\nDeadline to apply is 2nd feb 2017 till 12.00 pm and is mandatory.</br>\ncompany name - ProtoTech solutions and services pvt ltd.</br>\ncompany website - www.prototechsolutions.com</br>\nJob location - Pune</br>\nPosition - Software Developer</br>\nSalary BE/Btech 2.75 LPA</br>\nMtech 3 LPA</br>\nDate of Drive - 11th feb 2017</br>\nTiming - 9:30 am</br>\nVenue - PVPPcoe</br>\nEligibilty criteria- 60% in 10th, 12th</br>\ndegree cgpi 6.06</br>\nAll branches</br>\nnon dream</br>\nSkills Required</br>\nCompulsory Programming Languages C/C++</br>\nPreferred (optional) Grapics programming,OpenGl, direct3d</br>\nExcellent communication skills</br>\nSelection Process</br>\n1 - Aptitude and Technical Test on C, C++</br>\n2 - Programming Test + English Skills Test</br>\n3 - Coding Test of 8 Hours</br>\n4 - Technical & HR Interview</br>\nclick on below link to register on portal</br>\nregards,</br>\nPlacement Team.</br>\n\n\n\n', '2017-01-30', '13:26:21', '26'),
(162, 'Quinnox revised criteria', 'Quinnox crp 2017</br>\r\nCriteria</br>\r\nonly degree cgpi 6.62 and above</br>\r\nIT AND COMPS.</br>\r\nno drops and no academic gaps.If you have any academic gaps in 12th, diploma or in degree please do not register.</br>\r\nlast date to register is 2nd february 2017 till 12pm noon.</br></br></br></br>\r\nPlacement Team.', '2017-02-01', '05:55:55', '27'),
