(165, 'Post offer connect program- \"Road to the Chequered Flag\"- Learning Capsule Overview', '\r\n\r\nDear Students ,\r\n\r\nFind the below mail we received from TCS regarding your joining details .\r\nThey will be conducting Webinar on this Friday 10th Feb 2017 .I want you to be present for the same. Time and venue I will share by tomorrow. \r\n\r\nMail By TCS :\r\n\r\nwe are kickstarting our Post Offer Connect Program for all the TCS offered students 2017 YOP from 10-Feb-2017. \r\n\r\nAs a first, we are having a webinar scheduled on 10-Feb-2017, Friday this week (The Login details, \"How to Join\" Guide\" as well as the agenda would be shared shortly for this Webinar today evening). \r\n\r\nThis would be a 4 months learning capsule starting from 10-Feb-2017 for students which would have a host of Webinars and Challenges which would help the students get a deeper understanding about the Pre Joining Formalities, Documentation proceedings, Career Path and Technology streams in TCS, TCS locations, Initial Learning Program centers, How joining date and location is defined, TCS units and business overview, Fitment of core engineering streams within TCS etc. \r\n\r\nRequest you to pls ask all the offered students to be a part of the same as going through this content can help them get an edge over their peers and also sharpen their understanding about TCS and our various Job Profiles. \r\n\r\nPls find the below poster appended which gives an idea about the whole capsule and what students can expect in the months to come. \r\n\r\nAs the Program Tagline goes, \"Know More, Learn More and Race to the Chequered Flag\". \r\n\r\nWe wish all the students a happy learning! For more details, students can visit our Mumbai Regional Channel on Campus Commune. The direct link for the same is given in the below poster. We have also appended a print ready format if you would like to display the same on notice boards of the institute. \r\n', '2017-02-08', '02:26:31', ''),
