(174, 'Multiplier Solutions CRP 2017', '<b>Company Profile: Multiplier Solutions</b></br> \r\nMultiplier Solutions is a fast growing company led by IIM, IIT, BITS Pilani talent and focused on new technologies of data analytics, CRM and social media marketing for the fast growing healthcare domain. </br> \r\nWe are a leading healthcare consulting and products company that has a suite of products that consumes large elements of data across healthcare eco-system and delivers advanced analytics. This is being adopted in leading healthcare companies of India.</br>       \r\nOur team includes people from IIM, IIT, BITS Pilani, SP Jain and people from healthcare that helps customers grow faster and reach more profitable markets.</br>  \r\nFor more details please visit:</br>\r\n<b>http://multipliersolutions.com/</b></br></br>\r\n\r\nAddress:</br> \r\nMultiplier Solutions</br>\r\nUnit 402, Millennium Square Building,</br>\r\nLumbini Avenue,</br>\r\nHitech Cross Roads,</br>\r\nOpposite Care Hospital,</br>\r\nNear Biodiversity Park,</br>\r\nGachibowli,<br>\r\nHyderabad</br></br>\r\n<b>Regards,</b></br>\r\n<b>Placement Team.</b> ', '2017-02-10', '12:02:19', '28'),
