(207, 'Mirraw CRP Schedule 21 April 2017 ', 'Dear Students ,\r\n\r\nMirraw CRP is schedule in our college on 21 April 2017  , on the day there will be only written  test ( Interviews are schedule at their office )\r\n\r\n\r\nReporting time : 10:30 AM \r\n\r\nVenue : 7th floor Class rooms \r\n\r\nNote : \r\n1. You have to opt any one position either Software Developer or Business Analyst from job profile,  check previous mail of registration for details .\r\n\r\nSAKEC Placement ', '2017-04-19', '06:58:00', ''),
