(212, 'Systenics Solutions Registration', '<b>Register only if interested. Not Compulsory</b>\r\n\r\nSystenics Solutions is software developer company focused at International Clients. They are looking to hire freshers to work on ASP.NET, AngularJS  technology.\r\n<br>\r\nCriteria\r\n<br>\r\nB.E. passout in 2017 from Computer and IT branch having CGPI >=6.76.\r\n<br>The candidates would be given training for 3 months. During training, the stipend would be Rs.5000/- per month. <br>\r\nPost training they would be working as Junior Software developer. <br>\r\n<br>one year bond.\r\n<br>Their CTC would be between Rs. 2.8 to 3 Lacs depending on their performance during training.\r\n<br><br>The selection process would be\r\n<br>Technical Interview\r\n<br>Final Interview\r\n<br>\r\nRegistration Deadline: 31/05/2017', '2017-05-30', '06:25:55', '39'),
(213, 'Systenics Solutions Interview Shedule', 'Dear Student, <br>\r\n\r\nYour interviews scheduled on <br>\r\n<b>Thursday 8th June, 2017 at 2 PM </b> <br>\r\n<b>venue:</b>\r\n<br>Systenics Solutions\r\n<br>Unit No. 18, 1st Floor, \r\n<br>The Affaires,\r\n<br>Plot No. 9, Sector â€“ 17,\r\n<br>Off. Palm Beach Road,\r\n<br>Sanpada, Navi Mumbai\r\n\r\n\r\n<br>The selection process would be\r\n\r\n<br>Technical Interview\r\n<br>Final Interview\r\n\r\n<b> <br>Send a confirmation mail to placement.sakec@gmail.com about your availability for the interview without fail.</b>', '2017-06-01', '04:30:20', ''),
(214, 'Mindgate Solutions Pvt. Ltd. Registration', '<b> Only for intrested. Not compulsory </b>\r\n<br>\r\nDear Student,\r\n<br><br>\r\nWe are happy to inform you that have planed to arrange a Pool Campus Placement Drive for Mindgate Solutions Pvt. Ltd.- 2017 Batch at PVPPCOE.\r\n<br>Please find the details in the link given below. If you are intrested then you can register for the same.\r\n<br>http://pvppcoe.ac.in/placement-notice\r\n\r\n<br><br>\r\n<b> Also register on placement portal by clicking link given below. Deadline: 07/06/2017.</B>', '2017-06-05', '10:03:41', '44'),
(215, 'Atidan Technology Registration', '\r\n			<b> Only for intrested. Not Compulsory </b>\r\n			<br>\r\n				<br>\r\nDear Student,\r\n\r\n\r\n					<br>\r\n						<br>We are happy to inform you that have planed to arrange a Pool Campus Placement Drive for Atidan- 2017 Batch at PVPPCOE.\r\n\r\n							<br>â€‹Aâ€‹ll the eligible and interested students need to apply for this  Pool Campus Drive on\r\n\r\n								<br>http://pvppcoe.ac.in/placement-notice\r\n\r\n											<br>About Atidan : Atidan Technologies, headquartered in US with offices in Mumbai and Pune. We are a Microsoft Gold Certified Partner working mainly in Microsoft Technology.\r\n\r\n												<br>www.atidan.com\r\n\r\n													<br>Job Responsibilities:\r\n\r\n														<br>Â·         Design, Architect and Develop Microsoft .Net and SharePoint solutions based on suitable design patterns\r\n\r\n															<br>Â·         Adopt new and emerging technologies to provide solutions to client needs\r\n\r\n																<br>Â·         Ability to understand client requirements and translate them into suitable solution architecture\r\n\r\n																	<br>Â·         Document key SDLC processes by producing formal documents like Business, Functional & System Requirement Specifications, etc.\r\n\r\n																		<br>Â·         Be flexible to work on varied technologies and cater to time difference needs\r\n\r\n																			<br>Â·         Excellent communication skills\r\n\r\n																				<br>Â·         Develop & support custom built applications and Participate in the product development\r\n\r\n																					<br>Â·         Participate in the analysis of requirements to understand the business and system needs regarding user interfaces, application enhancements, new functionality, and back-end processes\r\n\r\n																						<br>Â·         Code and modify simple applications using programming tools. Document all code using standard forms and procedures, adhering to all naming conventions\r\n\r\n																							<br>Â·         Create reports and work with others in the technical and analytical aspects of report creation\r\nParticipate in unit, system, and user acceptance testing\r\n\r\n																								<br>Skills:\r\n\r\n																									<br>Â·         C#, Win forms, Web Forms, ASP.net, XML, WPF, Silverlight, Web Services\r\n\r\n																										<br>Â·         Experience in handling RDBMS such as Sql Server or Oracle\r\n\r\n																											<br>Â·         Experience in a developing web applications using Asp.net and C#\r\n\r\n																												<br>Job Description:\r\n\r\n																													<br>â€¢ Will be a part of product development team following an agile development methodology.\r\n\r\n																														<br>â€¢ You will work with the stakeholders (management / other teams) to ensure requirements are implemented and actively participate in daily/iteration meetings.\r\n\r\n																															<br>â€¢ The ideal candidate will be a bright, enthusiastic graduate with knowledge of agile development environment on the Windows platform, for a product development company.\r\n\r\n																																<br>\r\n																																	<br>\r\nCriteria:\r\n\r\n																																		<br>Education:  B.E COMP/IT CGPI>=6.76\r\n\r\n																																			<br>Designation: .Net Developer \r\n\r\n																																				<br>Salary: 3.5 lakhs \r\n\r\n																																					<br>Campus Date - Will be informed later to the registered students. \r\n\r\n																																						<br>Campus Venue - PVPPCOE\r\n\r\n																																							<br>Location: Mumbai, India \r\n\r\n																																								<br>\r\n																																									<br>HOW TO APPLY:\r\n\r\n																																										<br>Â·         Please fill the Registration Form\r\n\r\n																																											<br>http://pvppcoe.ac.in/placement-notice\r\n\r\n\r\n																																												<br>\r\n																																													<br>\r\n																																														<b> also register on placement portal by clicking on link given below Deadline:07/06/2017</b>\r\n																																											', '2017-06-05', '10:47:51', '43'),
(216, 'CRP : CAPIOT Software Pvt. Ltd', 'Dear Students ,\r\n\r\n CAPIOT Software Pvt. Ltd. CRP is scheduled on 1st July 2017 at their office .\r\n\r\nThere will be direct interview ( Technical +HR) \r\n\r\nReporting Time : TBA \r\n\r\nCriteria :  B.E. Computer Science/IT Engg students  Aggregate CGPA as 7.25 or above.\r\n\r\nRegistration Deadline : 29th June 2017 ( Till 3 PM)\r\n\r\nCompany profile and Benefits :\r\n\r\nJob Profile attached with the mail .\r\nCompensation and benefits:\r\n\r\nThe CTC we would offer is Five Lakhs per annum which would be a 90:10 compensation pattern where 90% would be fixed base salary and 10% would be target incentive.\r\n\r\n CAPIOT Benefits plan would be over and above the Annual Fixed Compensation which includes:\r\n\r\nInsurance: 100% premium paid by company\r\n\r\nÂ·  Health/Medical Insurance Cover  (For employee, spouse, two dependent children) of  INR 5,00,000\r\n\r\nÂ·  Personal Accident Insurance for employee (Three times the annual fixed salary)\r\n\r\nÂ·  Gratuity - Applicable after five years of continuous service with CAPIOT Software India as per Gratuity Act\r\n\r\nÂ·  Leaves - Earned leaves: 20 | Sick leaves: 12 \r\n\r\n\r\n\r\nNote : Only Registered Students will be allowed to appear for the interview process.\r\nREGISTRATIONS WILL BE ACCEPTED TILL 29TH JUNE 2017  3:30 PM ONLY. \r\nPLEASE DO NOT SEND ANY EMAILS TO EMAIL ID IN THE PDF. THAT IS ONLY FOR THE PLACEMENT DEPT. \r\n\r\nPlacement Team \r\n\r\nSAKEC\r\n\r\n', '2017-06-29', '01:37:04', '45'),
