(431, 'Student Development Program', 'Dear Students, \r\nTraining and Placement Department has organized a Student Development Program session by IBS on 2nd August,2017 from 10AM to 12:30 AM. The Reporting time is 09:30 AM. You can register on or before 01st August,2017 till 10:00 PM. \r\nYou have to be present in Formal Dress. ', '2017-07-31', '09:03:52', '56'),
(432, 'Mock Test 2', 'Dear Students,\r\nTraining and Placement Department has organized a Written Mock Test 2 on 2nd August,2017 from 03:00 PM to 04:00 PM. The reporting time is 02:30 PM. You have to be present in Formal Dress. The venue will be your respective classroom. The students who has Morning Session of IBS has to meet their respective project Guide between two sessions.', '2017-07-31', '09:34:50', '57'),
(433, 'Reliance JIO CRP', 'Dear Students,\r\nThe Registration for Reliance Jio CRP is started. You have to register for the same on or before 3rd August, 2017 12:30 PM.\r\nThe Criteria for company is 60% Throughout (SCC + HSC/Diploma + Degree). If are satisfying the criteria then register before deadline to avoid inconvenience.  The further details will be informed you shortly.', '2017-08-02', '02:17:49', '58'),
(434, 'Defaulter Meeting', 'Dear Students,  meeting for defaulter students is schedule on 4th august 2017 at 12:45 PM  in lab 404 , fourth floor. All defaulter students have to present in formal on time. Failure to this will result in out of CRP-2018. ', '2017-08-03', '04:28:26', ''),
(435, 'Aptitude Training and Group Discussion', '<b>Dear Students,</b></br>\r\nThe Training and Placement Department has organized a Aptitude Training Session on 5th August, 2017 at 10:00 AM to 12:00 PM and Group Discussion from 12:00 PM to 02:00 PM. </br>The reporing time for session is 09:30 AM and venue is 7th Floor Auditorium. All the students have to be present in formal. </br>\r\n<b>Deadline for registration is till 11:59 PM tonight.</b>', '2017-08-04', '05:06:52', '59'),
