(438, 'Training Session', '<b>Dear Students,</b></br>The Training & Placement Department has scheduled a Session by Kotak Sir on 9th August, 2017 at 09:30 AM. The reporting time is 09:15 AM. The venue is 7th Floor Auditorium.<b>All the students have to be present in formal.</b>The session is compulsory for all who want to participate in any CRP 2018 activity.', '2017-08-08', '02:04:11', ''),
(439, 'Training Session', '<b>Dear Students</b>,\r\nThe Training and Placement Department has scheduled a Training Session on 9th August,2017 at 10:00 AM. The venue is 7th floor auditorium. All of u have to be present in formals and reporting time is 09:45 AM.\r\nSession 1 by Kotak Sir from 10:00 AM to 10:20 AM, Session 2 by Dasari Sir from 10:20 AM to 12:15 PM, Session 3 by Atul Sir from 03:00 PM to 05:00 PM.\r\nBetween 12:20 PM to 03:00 PM you have to meet your respective project guide.', '2017-08-08', '02:36:21', '60'),
(440, 'Verification Process', '<b>Dear Students</b>,</br>The document verification and details verification can be done tomorrow. For details verification you have to bring one set of documents to the following staff members. This is the last option to update your details on the Placement Portal.</br>\r\n<b>List of Staff Members.</b></br>\r\n<i>BE1-Mamta Madam</i></br>\r\n<i>BE2-Amit Sir</i></br>\r\n<i>BE3-Dipti Madam</i></br>\r\n<i>BE4-Atul Sir</i></br>\r\n<i>BED-Vaishali Madam</i></br>\r\n<i>BE5-Abirami Madam</i></br>\r\n<i>BE6-Rashmi Madam</i></br>\r\n<i>BE7-Gauri Madam</i></br>', '2017-08-08', '00:00:00', ''),
(441, 'Important Message', '<b>Dear Students</b>,</br>\r\nTomorrows all Sessions has been postponed. Next date and time we will inform you later.</br><b>But You have to register for the Sessions before the Deadline if Link is provided for registration.<b>', '2017-08-08', '00:00:00', ''),
(442, 'Alumni Talk', '<b>Dear Students</b></br>The Training and Placement Department has organized a Alumni Talk by <b>Mr. Gandhar Suryavanshi</b> on <b>14th August,2017 from 08:00 AM to 10:00 AM</b>. All of you have to be in formal. The reporting time is 07:50 AM and venue is 7th Floor Auditorium.</be>Deadline is 12th August 2017.', '2017-08-11', '03:54:44', '61'),
(443, 'Interns at Merilent India Private Limited', '<b>Dear Students,</b></br>The registration for Interns at Merilent India Private Limited is started by Training and Placement Department.</br>The Deadline for registration is Thursday 17th August,2017.</br>FInd the relevant document in an attachment.', '2017-08-14', '03:42:10', '62'),
(444, 'Training Session', '<b>Dear Students,</b></br>The Training Session by Dr. V. C. Kotak is rescheduled on 16th August 2017 from 09:30 AM to 10:00 AM at 7th Floor Auditorium. </br>The reporting time is 09:15 AM.', '2017-08-14', '04:02:52', ''),
(445, 'Training Session', '<b>Dear Students,</b></br>\r\nThe Training & Placement Department has organized following sessions on 16th August 2017.</br>\r\nSession 1----------Dr. V. C. Kotak------------------10:00 AM to 10:30 AM</br>\r\nSession 2 by Ms. Sanghamitra Mitra from Capgemini on Application of Data Sciences from 10:30 AM to 12:00 PM.</br>\r\nSession 3 -----------Aptitude Training Session from 03:00 PM to 05:00 PM</br>\r\nDeadline for Registration is 15th August 2017 and reporting time for session is 09:45 AM at 7th floor auditorium.</br>', '2017-08-14', '04:55:34', '63'),
(449, 'Performance  Coaching', '<b>Dear Students<b></br>The Placement and Training Department has organized a Non Verbal Communication Session by Ms. Sumagna Bhowmick on 23rd August, 2017 from 12:30 PM at 4th Floor Auditorium.</br> The criteria for session is </br> SSC (more than 70%) , HSC/Diploma (more than 70%), Degree Pointer (more than 5.5), No Drop</br>The deadline for registration is 21st August,2017.', '2017-08-18', '06:02:29', '64'),
(450, 'Mock Test', '<b>Dear Students</b></br>The Training and Placement department has organised a Mock Test on 23rd August 2017 from 03:30PM to 04:30 PM.</br>The deadline for registration is 22nd August 2017.</br>Computer students will go to lab 209, The IT students will go to lab 507 and Electronic students will go to lab 612.</br>The reporting time is 03:00 PM. You have to be in formals.', '2017-08-21', '01:24:54', '65'),
(452, 'Performance Coaching', '<b>Dear Students<b></br>The Placement and Training Department has organized a Non Verbal Communication Session by Ms. Sumagna Bhowmick on 23rd August, 2017 from 12:30 PM at 4th Floor Auditorium.</br> The criteria for session is </br> SSC (more than 70%) , HSC/Diploma (more than 70%), Degree Pointer (more than 5.5), No Drop</br>The deadline for registration is 21st August,2017.', '2017-08-21', '05:48:32', '64'),
(453, 'Verification Reminder', '<b>Dear Students</b>,</br>The document verification and details verification have to be done before Thursday 24th August 2017. For verification you have to bring one set of documents to the following staff members. This is the last option to update your details on the Placement Portal.</br>You have to meet the following staff member for verification even if you have done it with your mentor</br>\r\n<b>List of Staff Members.</b></br>\r\n<i>BE1-Mamta Madam</i></br>\r\n<i>BE2-Amit Sir</i></br>\r\n<i>BE3-Dipti Madam</i></br>\r\n<i>BE4-Atul Sir</i></br>\r\n<i>BED-Vaishali Madam</i></br>\r\n<i>BE5-Abirami Madam</i></br>\r\n<i>BE6-Rashmi Madam</i></br>\r\n<i>BE7-Gauri Madam</i></br>', '2017-08-22', '12:40:00', ''),
(456, 'Important Message', 'Dear Students,</br> <b>You will not be allowed to appear for any Off Campus Recruitment Drive without intimating to Placement Cell.</b>', '2017-09-08', '07:16:51', ''),
(457, 'Training Session', 'Dear Students,</br>Training  and Placement Department has scheduled a Training Session on 16th September 2017 from 10:00 AM to 12:00 PM and 01:00 PM to 03:00 PM.</br>The reporting time is 9:45 AM and venue is 7th floor auditorium.</br>The last date of registration is 15th September 2017.</br>The session is for below 6.75 CGPI.', '2017-09-13', '15:20:20', '66'),
(458, 'Defaulters', 'You have been added to defaulter due to', '2017-09-15', '13:39:01', ''),
(459, 'DICE Boot Camp Activity at ISDI', 'Dear Students,</br><b>IEEE SAKEC</b>in association with <b>Training and Placement Department</b> is organizing the DICE Boot Camp Activity at ISDI. <b>The registration is Compulsory for all.</b> </br>For more details and registration<a href=https://www.facebook.com/events/523801948011905/ target=_blank>  Click here.</a>\r\n</br>Register for events as early as possible.', '2017-09-18', '14:57:18', ''),
(460, 'Capgemini CRP 2018 Registration', 'Dear Students,</br>We have started the registration process for Capgemini CRP 2018.</br>The Company is scheduled on 21st and 22nd September 2017.</br><b>Eligibility criteria for the students to participate in the Campus Recruitment Process is:</b></br><ul><li>Student should complete his/her Graduation in the year 2018</li><li>Should have scored 60% or above in academics SSC , HSC and graduation (aggregate of 4/5 semesters in graduation).</li><li>Only 1 year gap is allowed post HSC (12th) and not after SSC (10th) or between the graduation years</li><li>Must have good English written / verbal communication skills</li><li>No live ATKT till 5th/6th semester or during Capgemini selection process</li></ol></br><b>Note for Students:</b></br><ul><li>Should be open for relocation to any of the company premises in India</li><li>Must be ready to sign a service agreement for 2 years</li><li>Should be willing to work for any of the Business Units/ Service lines.</li></ul></br>If you are satisfying above critera then register on or before 08:00 AM on 20th September 2017.', '2017-09-19', '16:03:19', '67'),
(461, 'Regarding Capgemini CRP 2018', 'Dear Studdents,</br> The Capgemini CRP 2018 is scheduled on 22nd September 2017. The reprting time is 06:50 AM and venue is Ground Floor. All of you have to be in formal dress.</br>Important Note:</br><b>You have to carry a complete Placement Kit, Actual Marksheets, Copies of Resume and Passport size photographs.</b></br>Different Rounds on the day of CRP:</br><ol><li>Online Test</li><li>Technical Interview</li><li>HR Interview</li></ol></br>There will be 80 minutes online test first consist of Aptitude, Logical Reasoning and English. It will be followed by 20 minutes code test which consist of C, C++, Java and Database questions.', '2017-09-20', '15:08:17', ''),
(462, 'Regarding Capgemini CRP 2018', 'Dear Students,</br>We shared your database with the Capgemini Company.As per their decision you are  not fitting in the criteria of the CRP process of Capgemini. Better luck next time. Do not report tomorrow.', '2017-09-21', '12:39:26', ''),
(463, 'Capgemini CRP 2018', 'Dear Students,</br>We have started the registration process for Capgemini CRP 2018.</br>The Company is scheduled on 22nd September 2017.</br><b>Eligibility criteria for the students to participate in the Campus Recruitment Process is:</b></br><ul><li>Student should complete his/her Graduation in the year 2018</li><li>Should have scored 60% or above in academics SSC , HSC/Diploma and degree pointer 6.55</li><li>Only 1 year gap is allowed post HSC (12th) and not after SSC (10th) or between the graduation years</li><li>Must have good English written / verbal communication skills</li><li>No live ATKT till 5th/6th semester or during Capgemini selection process</li></ol></br><b>Note for Students:</b></br><ul><li>You have to secure overall aggregate 6.75 CGPA before joining.</li><li>Should be open for relocation to any of the company premises in India</li><li>Must be ready to sign a service agreement for 2 years</li><li>Should be willing to work for any of the Business Units/ Service lines.</li></ul></br>If you are satisfying above critera then register on or before 08:00 PM on 21st September 2017.', '2017-09-21', '13:27:41', '68'),
(464, 'Regarding Capgemini CRP 2018', 'Dear Studdents,</br> The Capgemini CRP 2018 is scheduled on 22nd September 2017. The reprting time is 06:50 AM and venue is Ground Floor. All of you have to be in formal dress.</br>Important Note:</br><b>You have to carry a complete Placement Kit, Actual Marksheets, Copies of Resume and Passport size photographs.</b></br>Different Rounds on the day of CRP:</br><ol><li>Online Test</li><li>Technical Interview</li><li>HR Interview</li></ol></br>There will be 80 minutes online test first consist of Aptitude, Logical Reasoning and English. It will be followed by 20 minutes code test which consist of C, C++, Java and Database questions.</br><b>Important instructions:</b></br><ul><li>Candidates to report to the venue on time. Any candidates without college ID card will not be allowed to appear for the test.</li><li>Mobile and Calculators are not allowed inside the lab.</li><li>Switching test window during the test will be captured online and will lead to disqualification.</li><li>Please ensure only eligible candidates as per Capgemini criteria should sit for the test.</li></ul></br><b>Test Pattern :</b><ol><li>Test 1 : Aptitude + Written English Test of 80 min</li><li>Result of Test 1 will be announced by Capgemini team</li><li>Shortlisted candidates will take the Test 2: Technical test : 20 min</li></ol>', '2017-09-21', '20:40:31', ''),
(465, 'Regarding Previous Messages', 'Dear Students,</br>Due to some technical issue you might have received some messages.Kindly ignore them.', '2017-09-24', '13:30:15', ''),
(466, 'Capgemini CRP 2018 Result', 'Dear Students,</br>Congratulations for getting selected in Capgemini. Kindly share your experience letter in Placement Cell till Monday afternoon.</br>Once again congratulations to you.', '2017-09-24', '13:34:42', ''),
(467, 'NSEIT CRP 2018 Registration', 'Dear Students,</br>The NSEIT CRP 2018 is scheduled on 27th September, 2017. </br> The criteria for company is:<ul><li>SSC: Above or equal to 57%</li><li>HSC/Diploma: Above or equal to 57%</li><li>Degree: Above or equal to 6.75 CGPA</li> </ul></br> The deadline for registration is 25th September, 2017 on or before 10:00 AM.', '2017-09-24', '14:03:32', '69'),
(469, 'Media.net CRP 2018 Registration', 'Dear Students,</br>The Media.net CRP 2018 is schedule on 9th and 10th October 2017.</br><b>Schedule</b><ul><li>Day 1:<ul><li>10:00 AM - Preplacement Talk</li><li>11:30 AM - Codechef Coding Contest</li></ul></li><li>Day 2:<ul><li>Interviews with the shortlisted candidates at Directplex (Time will be confirmed at a later date)</li></ul></li></ul></br> You have to visit<a href=\"http://www.codechef.com\" target=\"_blank\"> www.codechef.com</a> and signup on the same, also share your contact details in the below Google Form before 29th September 2017.</br>Google Form:- <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSf4ItwgOHwebH-8GTinBv5Epc6sPGNSc_-cHRvJzePtVq8UaA/viewform\" target=\"_blank\">Media.net  on Campus - Shah and Anchor 2017</a></br></br><b>Job Description:</b><ul><li>Application Engineer: 12.5 LPA</li><li>Associate Web Developer: 5.2 LPA</li><li>Associate Database Developer: 5.2 LPA</li></ul></br>Criteria:<ul><li>6.25 Aggregate CGPA</li><li>Branch: Computer and Information Technology</li></ul></br><b>Students who fail to fill up the Google Form and Register on Placement Portal would not be allowed to sit for Media.net placement.</b></br>Deadline for registration is 29th September 2017.', '2017-09-26', '13:14:21', '71'),
(470, 'NESIT CRP 2018 Volunteer', 'Dear Students,\r\n\r\nNESIT CRP 2018 is scheduled on 22nd September 2017. You people have been selected as volunteers for the same. The reporting is 06:50 AM. Be in the formal.\r\nPresentment is Compulsory.', '2017-09-26', '07:38:52', ''),
(472, 'NSEIT CRP 2018', 'Dear Students,</br>NSEIT CRP 2018 is scheduled on 27th September 2017. All of you have to report at 08:00 AM in formal dress. The venue is 7th floor auditorium. The schedule is Pre-Placement Talk, Online Aptitude Test, Technical Test, Technical Discussion, Manager Round and HR Round.', '2017-09-26', '07:45:29', ''),
(473, 'NSEIT CRP 2018 Volunteers', 'Dear Students,</br> NSEIT CRP 2018 is scheduled on 27th September 2017. You people have been selected as volunteers for the same. The reporting is 08:00 AM. Be in the formal.<b> Presentment is Compulsory.</b>', '2017-09-26', '09:32:29', ''),
(474, 'Vistaar CRP 2018 Registration ', 'Dear Students,</br>The Vistaar CRP 2018 is scheduled on 28th September, 2017. The criteria for company is:</br>\r\n<ul><li>No Live KT</li><li>Branch: Computer and Information Technology</li><li> No Drop during BE or Diploma.</li></ul></br>If you are satisfying above criteria then  registration on or before 27th September, 2017 on or before 11:30 AM.', '2017-09-26', '12:39:24', '70'),
(476, 'Vistaar CRP 2018', 'Dear Students,</br>The Vistaar CRP 2018 is postponed. The revised schedule will be informed to you. </br><b>Your regular lecture and practicals will be there</b>', '2017-09-27', '07:19:20', ''),
(477, 'NSEIT CRP 2018 Result', 'Dear Students,</br>Congratulations for getting selected in NSEIT. Kindly share your experience letter in Placement Cell till Monday afternoon.</br>Once again congratulations to you.', '2017-09-28', '04:10:41', ''),
(478, 'Regarding CRP Preparation', 'Dear Students,</br>Use following link to prepare for Campus Recruitment Training</br>\r\nhttps://www.youtube.com/playlist?list=PLY3DFj1jjj0URoyHOnxuau6l0EgzOtoHI', '2017-10-03', '04:48:01', ''),
(479, 'Media.net CRP 2018 Registration', 'Dear Students,</br>The Media.net CRP 2018 is schedule on 9th and 10th October 2017.</br><b>Schedule</b><ul><li>Day 1:<ul><li>10:00 AM - Preplacement Talk</li><li>11:30 AM - Codechef Coding Contest</li></ul></li><li>Day 2:<ul><li>Interviews with the shortlisted candidates at Directplex (Time will be confirmed at a later date)</li></ul></li></ul></br> You have to visit<a href=\"http://www.codechef.com\" target=\"_blank\"> www.codechef.com</a> and signup on the same, also share your contact details in the below Google Form.</br>Google Form:- <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSf4ItwgOHwebH-8GTinBv5Epc6sPGNSc_-cHRvJzePtVq8UaA/viewform\" target=\"_blank\">Media.net  on Campus - Shah and Anchor 2017</a></br></br><b>Job Description:</b><ul><li>Application Engineer: 12.5 LPA</li><li>Associate Web Developer: 5.2 LPA</li><li>Associate Database Developer: 5.2 LPA</li></ul></br>Criteria:<ul><li>6.00 Aggregate CGPA</li><li>Branch: Computer and Information Technology</li></ul></br><b>Students who fail to fill up the Google Form and Register on Placement Portal would not be allowed to sit for Media.net placement.</b></br>Deadline for registration is 5th October 2017.', '2017-10-04', '03:59:25', '72'),
(480, 'InQuizitive Minds', 'Dear Students,</br>Training and Placement Department in association with InQuizitive Minds is organising a Written Test on 12th October 2017. The reporting time is 10:00 AM and venue is 7th floor auditorium. You have to be present in formals and have to bring the writing pads.</br><b>What is InQuizitive Minds:</b></br>The nation\'s biggest quiz challenge conducted across schools and colleges. But it is not just a competition. It is an endeavour to encourage young India to explore, learn and know more about what\'s happening around the world. A platform which drives them to be inquisitive, ask questions and develop their individuality.</br><b>\r\nOur Legacy:</b></br>We were CL Young India Challenge. Empowering the young generation to reach their fullest potential through the largest digital and face-to-face youth connect program in the nation.</br><b>The format:</b></br>5 levels of general quizzing to stir your student\'s InQuizitive Minds.<ol><li>Level 1: Preliminary Round</li><li>Level 2: City Round</li><li>Level 3: Regional Round</li><li>Level 4: Semifinal</li><li>Level 5: Finale</li></ol></br><b>Cash Prizes & Trendy Goodles</b><ol><li>Winner: Cash Reward of Rs. 1 Lakh</li><li>First Runner-up: Cash rewards of Rs. 50 Thousand</li><li>Second Runner-up: Cash rewards of Rs. 25 Thousand</li></ol>\r\n<b>Plus trophies, certificates and bagful of amazing goodies</b></br><b>\r\nCareer guidance by the best mentors in the industry.</b></br></br>The last date of Registration is: 11th October 2017 and registration is compulsory for all.', '2017-10-10', '11:14:27', '73'),
(481, 'Vistaar CRP 2018', 'Dear Students,</br>Vistaar CRP 2018 is scheduled on 11th October 2017. All of you have to report at 11:00 AM in formal dress. The venue is 7th floor auditorium. The schedule is Pre-Placement Talk, Written Test.', '2017-10-10', '06:40:46', ''),
(482, ' Vistaar CRP 2018 Volunteer', 'Dear Students,</br> Vistaar CRP 2018 is scheduled on 11th October 2017. You people have been selected as volunteers for the same. The reporting is 11:00 AM. Be in the formal.<b> Presentment is Compulsory.</b>', '2017-10-10', '06:45:37', ''),
(483, 'L & T CRP 2018', 'Dear Students,</br>The L & T CRP 2018 is scheduled on 26th and 27th October 2017.</br>The criteria for comapny:</br>\r\n<ul>\r\n<li>SSC and HSC/Diploma greater than 60</li>\r\n<li>Degree CGPI 6.25 and more</li>\r\n<li>No drops during Diploma, Degree.</li>\r\n<li>Number of live kt and dead kt must not be greater than 4.</li>\r\n<li>Age should not be greater than 24 years</li>\r\n<li>While joining L & T your aggregate CGPA should be 6.75 or more.</li>\r\n</ul>\r\nThe deadline for registration for is 22nd October 2017.', '2017-10-17', '16:11:26', '74'),
(484, 'LIT Volunteer', 'Dear Students,</br>LTI CRP 2018 is scheduled on 26th October 2017. You people have been selected as volunteers for the same. The reporting is 08:00 AM. Be in the formal.<b> Presentment is Compulsory.</b>', '2017-10-25', '07:48:51', ''),
(485, 'LTI CRP', 'Dear Students,</br>\r\nLTI CRP is scheduled on 26th October 2017. The reporting time is 08:00 AM in 7th floor auditorium. All of you have to be in formals.\r\n</br>\r\n<ol>\r\nCandidates attending this drive must carry:\r\n<li>Completely filled hard copy of the attached Trainee Application form & Self-Declaration form (Printed back to back)</li>\r\n<li>*Original mark sheets of 10th, 12th or Diploma (All semesters) and Graduation course (all semesters) including ATKT/Backlog/Arrears mark sheets(if any) along with relevant technical certificates (*mandatory).</br><b>Bring all original marksheets which are vaialble with you without fail.</b></li>\r\n<li>2 latest passport size photographs along with a Copy of their Resume</li>\r\n</ol>\r\n<ul>The Schedule for tomorrow:</br>\r\n<li>Preplacement Talk</li>\r\n<li>Online Test</li>\r\n<li>Group Discussion</li>\r\n<li>Paragraph Writing</li>\r\n<li>Technical Interview</li>\r\n<li>HR Interview</li>\r\n</ul>', '2017-10-25', '09:59:55', ''),
(486, 'LTI CRP VOLUNTEER ', 'Dear Students,</br> You have been selected as volunteer for LTI CRP scheduled on 27th October 2017. You have to be in formals and reporting is 08:00 AM.', '2017-10-26', '08:08:45', ''),
(487, 'LTI CRP VOLUNTEER ', 'Dear Students,</br> You have been selected as volunteer for LTI CRP scheduled on 27th October 2017. You have to be in formals and reporting is 08:00 AM.', '2017-10-26', '08:09:51', ''),
(488, 'LTI CRP 2018 Result', 'Dear Students,</br>Congratulations for getting selected in LTI. Kindly share your experience letter in Placement Cell till Monday afternoon.</br>Once again congratulations to you.', '2017-10-27', '12:46:42', ''),
(490, 'TCS CRP 2018 Registration', 'Dear Students,</br>We are starting CRP registration for Tata Consultancy services ( TCS) for 2018 Batch </br>\r\n<ol>\r\nFor enrolling yourself for TCS CRP follow steps given below :\r\n<li>\r\nFirst fill College Registration ( ON Placement Portal)\r\n</li>\r\n<li>\r\nFill the <a href=\"https://goo.gl/2VqTwL\" target=\"_blank\">google form</a>.\r\n</li>\r\n<li>\r\nFill online form available on <a href=\"https://nextstep.tcs.com/campus/\" target=\"_blank\"> https://nextstep.tcs.com/campus/</a>..... Read instruction given in Attachment.\r\n</li>\r\n</ol>\r\n</br><b>All three registrations are compulsory.</b></br>The deadline is 1st November 2017 till morning.</br>If you have any doubt you can meet Dr. Nilakshi Jain in lab 402 on Wednesday morning.', '2017-10-30', '15:02:47', '75'),
(491, 'Urgent !!! LTI CRP 2018 Registration on their portal', 'Dear Students</br>Complete the LTI registration process on their portal before 31st October 2017, 04:00 PM. If you fail to complete within deadline strict action will be taken. If you dont have  original then upload xerox.', '2017-10-31', '03:41:22', ''),
(492, 'TCS Registration Update', 'Dear Students ,\r\n\r\nHope you have filled the complete application form on https://nextstep.tcs.com/campus/  and submitted the form properly.  Now  you can check  your status  on the Track My Application  menu, on the left hand side of the screen ,your status should appear as Application Received. We will intimate you once Apply on The Drive option will be enabled. ', '2017-11-02', '01:53:00', ''),
(493, 'GS LAB CRP', 'Dear Students,</br>We have started the registration for GS LAB CRP for batch 2018.</br>Criteria is: SSC-60%, HSC-56%, Diploma-60% and Degree 6.75 or more CGPA, Branch: Computer and IT.</br>\r\n<b>Position</b>:Software Development Engineer</br>\r\n<b>Requirement</b><ul><li>Strong knowledge of C, C++, programming Skills.</li><li>Strong understanding of Relational database concepts</li></ul></br>\r\n<b>Rounds:</b><ol><li>Online Test:<strong>On 7th November 2017 and you can give at any time on particular day.</strong></li><li>Technical Interviews</li><li>HR Interviews</li></ol></br>\r\n<b>Package: 4.5 LPA on completion of 6 months as Trainee. Candidates will be given stipend of Rs.15000/- per month for the first 6 months.</br>\r\nFor registration on company portal <a href=\"https://earlybird.myanatomy.in/candidate/52e56b75-0e53-491d-8db2-e0e5b409a6bd1509605079664\"  target=\"_blank\">click here for Company Registration</a>.</br>\r\n<b>Both the registrations are compulsory( College + Company )</b></br>\r\n<b>The last date for registration is 5th November 2017.</b></br>\r\n<b>Note: The Online test is on 7th November 2017 and you can give at any time on that particular day</b>', '2017-11-02', '12:36:25', '76'),
(495, 'Ufaber CRP Registration', 'Dear Students,</br>\r\nWe have strated the Registration process for Ufaber CRP for 2017 Batch.</br>\r\n<b> Its a complete marketing profile if interested then only register </b></br>\r\n<b>A brief about the company</b>:</br>\r\n<p align=justify> uFaber is Indias fastest growing EduTech company founded by alumni of IIT. uFaber has helped more than 100,000 students with high quality education. uFaber uses a unique pedagogy with personalised learning to every student to help clear some of the toughest examinations in the country. Comprising of an energetic, enthusiastic  and creative team, uFaber has expanded within a short span of time to a team of 260 people and over 10 locations in India, growing further at a very aggressive rate on a weekly basis.</p></br>\r\n<b>A brief about the role</b>:</br>\r\nThe role of a Business Development Manager would require the following skills:\r\n<ul>\r\n<li>Managerial Skills: Managing all ground operations needed for setting up and running the long stay properties</li>\r\n<li>Leadership Skills: Supervising associates and managing a team of folks under them</li>\r\n<li>Strong Communication and Street Smartness: Interacting with various students and showing smartness according to the scenario.</li>\r\n</ul></br>\r\n<b>Remuneration</b>:</br>\r\nCTC starting from 1.8 Lpa to 3 Lpa (Variables exclusive). Internship will be 8K to 12K .If we like the candidate, we would offer him equity making him an owner of the company in his own right.</br>\r\n<b>Deadline for Registration: Monday 6th November 2017, 10:00 AM</b>', '2017-11-04', '03:54:55', '78'),
(496, 'GS Lab CRP 2018', 'Dear Students,</br>The GS Lab Online Test is scheduled on 7th November, 2017 at 03:00 PM. </br> You have to be present in formals in lab 507 at 02:30 PM.</br> If you have any Practical, Oral, Project Exam try to finish it before 02:00 PM,  and make yourself available for the Exam.</br>The online test has following sections:<ul><li>Aptitude</li><li>Reasoning</li><li>Coding</li><li>English Comprehension</li></ul></br><strong>2.5 Hours Online Test</strong></br>Link will be provided to you in mail, but you should not login before 03:00 PM.', '2017-11-06', '05:30:12', ''),
(497, 'TCS CRP 2018', 'Dear Students</br><strong>TCS online test is scheduled on 11th November 2017. The further scheduled will be informed soon.</strong>', '2017-11-08', '12:38:07', ''),
(498, 'TCS CRP 2018', 'Dear Students,</br> The TCS CRP 2018 is scheduled on 11th November 2017 at 08:45 AM. Print of call letter received on your respective email ID. Scan copy of college ID proof is also required. Tomorrow is online test only for 100 minutes. Venue is ground floor.', '2017-11-10', '05:36:54', ''),
(499, 'TCS CRP 2018 Volunteer', 'Dear Students, </br> The TCS CRP is scheduled on 11th November 2017. The reporting time is 08:30 AM. You have to be in formals. You have to meet Lukesh Kadu sir and Amit sir. Attendance is compulsory.', '2017-11-10', '05:49:26', ''),
(500, 'Vistaar CRP 2018', 'Dear Students,</br>Congratulations you are shortlisted for further round for Vistaar CRP.</br>Your Technical interview is scheduled on <strong>Friday,17th November 2017 at 09:30 AM</strong>.</br>Venue:</br>Vistaar Systems Pvt. Ltd., Raheja Point 1, Wing A,\r\nPt. J. N. Road, Vakola, Santacruz (East), Landmark: Near SVC Tower OR Diagonally opposite to Vakola Church.</br>Contact Person: Mr. Mahendra More.', '2017-11-14', '09:08:26', '');
