(501, 'Vistaar CRP 2018', 'Dear Students,</br>Congratulations you are shortlisted for further round for Vistaar CRP.</br>Your Technical interview is scheduled on <strong>Friday,17th November 2017 at 10:30 AM</strong>.</br>Venue:</br>Vistaar Systems Pvt. Ltd., Raheja Point 1, Wing A,\r\nPt. J. N. Road, Vakola, Santacruz (East), Landmark: Near SVC Tower OR Diagonally opposite to Vakola Church.</br>Contact Person: Mr. Mahendra More.', '2017-11-14', '09:12:29', ''),
(502, 'Mphasis Pool Campus', 'Dear Students,</br>\r\nA Pool Campus drive of Mphasis on 17th November 2017 for BE Students  2018 batch with no percentage criteria atT Vishwaniketan iMEET (Survey Nos: 52, 54, 55, 56, 57 Kumbhivali, Tal- Khalapur, Raigad, Maharashtra 410202) is arranged.</br>\r\n<b>Company Name</b>: Mphasis Ltd</br>\r\n<b>Company Profile</b>:</br>\r\nMphasis is a USD 1 billion global service provider, delivering technology and process based solutions to customers across the world. Every day, we help our clients explore innovative ways to respond to market dynamics with agility and speed, reduce costs with less risk, and increase productivity to enable growth. We provide end-to-end IT and Business Process Services that bring efficiency to critical operations and facilitate ongoing evolution of our stakeholdersâ€™ businesses.</br>\r\n<b>Company Website</b>: <a href=\"http://www.mphasis.com/\" target=\"_blank\">http://www.mphasis.com/</a></br>\r\n<ul>Job Description:\r\n<li>Understand clientâ€™s requirement.</li>\r\n<li>Processing tasks assigned as per defined process SLAâ€™s.</li>\r\n<li>Meeting individual KRAâ€™s.</li>\r\n<li>Adhere to Compliance.</li>\r\n<li>To Respond to customer queries via inbound calls, emails, chat and web tickets within defined SLAâ€™s.</li>\r\n<li>Logging incidents and service requests, categorizing and prioritizing them, and managing their life cycle as per ITIL guidelines.</li>\r\n<li>Update users about request status and close request when users are satisfied with solutions.</li>\r\n<li>Troubleshooting mainly related to desktop/OS, Custom and COTS applications, Exchange related, End devices, VPN, VOIP and share point as per guidelines in the knowledgebase.</li>\r\n<li>Remote desktop troubleshooting. Escalate complex incidents / requests to upstream technical groups.</li>\r\n</ul>\r\n<ul>Eligibility criteria:</br>\r\n<li>Graduation- BE (IT / Computers / Electronics / EXTC)</li>\r\n<li>Backlog: There should be no current backlog(s)</li>\r\n</ul>\r\n<ul>Skills:\r\n<li>Excellent Communication skills (Written & Verbal)</li>\r\n<li>Good Analytical, logical and reasoning skills</li>\r\n<li>Computer Fundamentals</li>\r\n<li>Good keyboard skills â€“ needs to be able to toggle between many screens with speed and needs to be able to type with speed and accuracy</li>\r\n</ul>\r\n</br><b>Salary: â‚¹ 1, 80,000 per annum</b>\r\n</br>\r\n<ol>Interview Process:\r\n<li>Group Discussion</li>\r\n<li>HR Round (face to face)</li>\r\n<li>Versant Test/ V & A Round</li>\r\n<li>Operations Interview (face to face)</li>\r\n</ol></br>\r\nJob Location:â€¢ Pune\r\n</br><ul>General Information:\r\n<li>Applicants should be willing to work in any of the above mentioned job locations</li>\r\n<li>Candidates would be required to attend the interview process ONLY at the Mphasis defined locations as advised by the Campus Recruitment Team only.</li>\r\n<li>Willingness to work in night / Rotational shifts</li>\r\n<li>5 days working and any 2 consecutive weekly offs</li>\r\n<li>Self-starter with an ability to work in a team environment.</li>\r\n<li>Must be able to handle the stress and pressure of SLAs</li>\r\n</ul></br>\r\n\r\n<strong>NOTE: Please register your enrollment on below link before 5:00 pm 16th November 2017.</strong></br>\r\n<a href=\"https://goo.gl/forms/rYi0Pfbm6yETTFA62\" target=\"_blank\">https://goo.gl/forms/rYi0Pfbm6yETTFA62</a></br></br>\r\nDeadline For Registration: <strong>16th November 2017, 05:00 PM.</strong></br>\r\n<strong>NOTE: Both the registrations are compulsory</strong>', '2017-11-15', '11:28:35', '79'),
