(510, 'TCS CRP 2018 Volunteer', 'Dear Students,</br> You have been selected as Volunteer for TCS CRP schedule on 18th November, 2017. You have to report to the college at 08:00 AM in formals. If due to any unavoidable circumstances you are not able to come then inform same by Mail to Training and Placement Officer and placement.', '2017-11-17', '04:20:02', ''),
(511, 'TCS ', 'Dear Students,</br>Those who appered for TCS Online Test conducted on 11th November, 2017, your result may declare by end of day.  Tentatively interview will be held in our college on 18th November, 2017. We will send you one confirmation mail as soon as possible from our end. Please check your mail and Placement Portal for further details.', '2017-11-17', '04:48:09', ''),
