(516, 'Ebornglobal CRP', 'Dear Students</br>\r\nwww.ebornglobal.com is SAP based company located in Thane. they are having opening for SAP functional / technical module:</br>\r\n<ul><li>BE fresher (Comp / IT/  EXTC) 2017 batch</li>\r\n<li>Good academics  with min 60% first class / distinction :  (10th /12th & BE)</li>\r\n<li>No ATKT and No year gap</li>\r\n<li>Male Candidates</li></ul>\r\n<strong>Interested candidates can email  <a href:mailto=\"nikita.jadhav@eborn.co.in\" > nikita.jadhav@eborn.co.in </a> their CVs.</strong>', '2017-11-28', '04:31:28', '81'),
(517, 'TCS CRP 2018 Online Test Result', 'Dear Student,</br>You have cleared the TCS CRP online test conducted on 11-Nov-2017 and is eligible for the interview process. </br><strong>We will keep you posted about the interview  date shortly. </strong></br>You  are required to carry the below mentioned documents for the interview process\r\n<ol>\r\n<li>TCS Application form printout</li>\r\n<li> College ID</li>\r\n<li> Resume </li>\r\n<li> Original mark sheets of Xth, XIIth, Diploma (all semesters)</li>\r\n<li> Original mark sheets of Graduation/Post Graduation (all semesters)</li>\r\n</ol>', '2017-11-29', '11:59:18', ''),
(518, 'Vistex CRP 2018', 'Dear Students,</br>We have started the registration process for Vistex CRP 2018. The criteria is:</br>Branch: Computer and IT, Degree avg: 6.25, no live kt.</br> The deadline for registration is till 17th December 2017, 11:59 PM. Further details will be provided to you.', '2017-12-16', '20:33:03', '82'),
(519, 'Atidan Company CRP 2018', 'Dear Students,</br> We have started the registration process Atidan Company. <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSfA69lAa5mXjLiMKzGvXV0Jyvl1yQD3palPWimflqSoVraWgg/viewform\" target=\"_blank\">For registration click here</a>. We will notify further details as early as possible.</br> <strong>The deadline for registration is 20th December, 2017 04:00 PM</strong>.', '2017-12-19', '11:42:47', '84'),
(520, 'Dolat Capital Market Private Limited CRP 2018', 'Dear Students,</br> We have started the registration process for Dolat Capital Market Private Limited CRP 2018.</br> The last date of Registration is 24th December, 2017.</br>', '2017-12-21', '09:10:17', '83'),
(521, 'Metro One CRP', 'Dear Students,</br>We have started registration for Metro One Drive.</br> Kindly note that these candidates shall appear for the RDSO Psychometric test, which is conducted by the Railways, then for the personal interviews.</br>\r\n The prerequisites  and ask the candidates to keep the below listed handy :-\r\n<ol>\r\n<li>Clear vision- 6/6- mandatory- no spectacles</li>\r\n<li>IT/ Computer - will not be considered.</li>\r\n<li>2 photograghs</li>\r\n<li>All documents- passing certificates  in original and photocopy</li>\r\n<li>Photo Identity proof-Aadhar card/PAN card/Passport.</li>\r\n<ol></br>\r\n<strong><a href=\"https://goo.gl/forms/6hIZxbygiMd40Mej1\">Please click on following link to register. </a></br><strong>Deadline is today till 6pm</strong>', '2017-12-22', '01:39:14', '85'),
(522, 'NeoSoft Recruitment Drive', 'Dear Students,</br>\r\n<ul>Eligibility Criteria:\r\n<li>BE : Computer, IT, ETRX,EXTC  (60% Aggregate No Backlogs) 2017 students only</li>\r\n<li>SSC,HSC or Diploma(60% through out)</li>\r\n<li>Excellent communication skills</li>\r\n<li>Thorough technical knowledge. </li>\r\n<li>Strong Analytical Skills.</li>\r\n<li>Good Academic Knowledge.</li>\r\n<li>Calm & pleasant personality.</li></ul>\r\n<br>Designation :Software Programmer\r\n</br>Package: 2.4 LPA and 2 year BOND.\r\n</br><a href=\"https://docs.google.com/forms/d/e/1FAIpQLScwsh_c6n0S4k4eHD7dMKki6FB4W4h5CEEcnkL0j0WarDPFQw/viewform\" target=\"_blank\">Click here to register.</a> </br><strong> Deadline for registration is 24th December 2017</strong>', '2017-12-22', '01:48:30', '86'),
(523, 'NeoSoft Recruitment Drive', 'Dear Students,</br>\r\n<ul>Eligibility Criteria:\r\n<li>BE : Computer, IT, ETRX,EXTC  (60% Aggregate No Backlogs) 2018 students only</li>\r\n<li>SSC,HSC or Diploma(60% through out)</li>\r\n<li>Excellent communication skills</li>\r\n<li>Thorough technical knowledge. </li>\r\n<li>Strong Analytical Skills.</li>\r\n<li>Good Academic Knowledge.</li>\r\n<li>Calm & pleasant personality.</li></ul>\r\n<br>Designation :Software Programmer\r\n</br>Package: 2.4 LPA and 2 year BOND.\r\n</br><a href=\"https://docs.google.com/forms/d/e/1FAIpQLScwsh_c6n0S4k4eHD7dMKki6FB4W4h5CEEcnkL0j0WarDPFQw/viewform\" target=\"_blank\">Click here to register.</a> </br><strong> Deadline for registration is 24th December 2017</strong>', '2017-12-22', '01:50:44', '87'),
(524, 'Test', 'Test', '2017-12-25', '05:34:46', ''),
(525, 'LTI CRP 2018', 'Dear Students,</br>We have started a registration for LTI CRP 2018 for 2017 passout students. <strong>The deadline for registration is 29th December, 2017.</strong></br>\r\nCriteria:<ul>\r\n<li>SSC /HSC/ Diploma: 55 % and above or equivalent CGPA without any gap.</li>\r\n<li> Age: Should be less than 24 </li>\r\n<li> Salary : 3.18 LPA</li>\r\n<li> 2 years service bond <li>\r\n<li> Job Location: Any development center </li>\r\n</ul></br>\r\nDetailed criteria is attached. Please find it and carry same while appearing for CRP Process after duly signed.\r\nTo register Click here: <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSfFuhges32Rw4difngYqinQbkkVh6-lsqM64tJka4_rvESw-g/viewform\" target=\"_blank\">Registration Link</a></br>\r\n<strong>Both the registration is compulsory.</strong>', '2017-12-26', '00:21:53', '88'),
(527, 'Godrej Infotech Ltd CRP 2018', 'Dear Students,</br> \r\nWe have started registration process for Godrej Infotech Ltd.</br> <strong>Deadline for registration is 10th January 2018 till 05:00 PM.</strong></br>\r\nClick Here to Register: <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSd3mUPigAKA-MSrcYZF685DdaCHVKfVyRXK4iDJyUv7CljM0A/viewform\" target=\"_blank\"> Registration Link </a></br>\r\n<strong> Both the registrations, college portal and Google form registration is compulsory. Failure of any one may result in rejection.</strong></br>\r\n COMPANY NAME: Godrej Infotech Ltd</br>\r\nCOMPANY PROFILE: </br>\r\n<p align=\"justify\">Godrej Infotech Limited, a subsidiary of Godrej & Boyce Mfg. Co. Ltd, which is one of the holding companies within the USD 4.1 billion Godrej Group. This group started its journey in 1897 and through the years have diversified from High Tech Engineering to Consumer Products.</br>Godrej Infotech Ltd is a software services and consulting company headquartered in Mumbai, India. Formerly an IT division of Godrej & Boyce Mfg. Co. Ltd., which started operations in 1971, Godrej Infotech Ltd, commenced its operations as a separate corporate entity on April 1, 1999.</br>Godrej Infotech Ltd, embarked on the journey of Business Excellence using EFQM 2013 (formerly known as The European Excellence Model Foundation for Quality Management), which outlines the foundation of achieving sustainable excellence in any organization.</br>We are assessed at SEI-CMM Level 4, which means our quality processes are well-defined and professionally managed. We also have ISO 9001:2015 Quality Systems Certification for Analysis, Design, Coding, testing, Delivery and Maintenance of Commercial Application Software, ERP Consultancy and Facilities Management Services.</p></br>\r\nPOSITION: Technical ERP-S/W Development </br>\r\nPrimary Skills :- Software Development</br>\r\nINTERVIEW PROCESS:-<ol>\r\n<li>Box test </li>\r\n<li>Aptitude Test </li>\r\n</ol></br>\r\nELIGIBILITY CRITERIA:-<ul>  \r\n<li>BE/BTECH , ME/MTECH, BCA/MCA, BSc IT MSc IT Graduates 2018</li>\r\n<li>60% - Through out</li>\r\n</ul></br>\r\nSpecialization:- Any Graduate</br>\r\nSALARY: 3,00,000 â€“ 3,50,000</br>\r\nYear Of Graduation: 2018 (Candidates who can join us immediately)</br>\r\nBOND:  Yes (2years)</br>\r\n EXPERIENCE: Fresher </br>\r\nJOB LOCATION: Godrej Infotech Limited | Plant-19A | Pirojshanagar | Vikhroli (W) | Mumbai- 400 079</br>\r\nInterview Date :- Will be intimated later</br>', '2017-12-29', '09:49:13', '90'),
(528, 'TCS CRP 2018', 'Dear Students, </br>\r\nThis is to keep you posted that the interview process for the studentsÂ who have cleared the test process has been scheduled on 6-Jan-2018. </br>We will keep you posted on the reporting time, venue and other details.</br>\r\nYou have to carry the below documents.</br>\r\n<ol>\r\n<li>TCS Application form printout</li>\r\n<li>College IDÂ </li>\r\n<li>Resume</li>\r\n<li>Original mark sheets of Xth, XIIth, Diploma ( all semesters )</li>\r\n<li>Original mark sheets of Graduation/Post Graduation(all semesters)Â </li>\r\n</ol></br>\r\nYou can not carry any form of media i.e pen drive,Â laptops, digital chips etc.Â ', '2018-01-01', '09:30:45', ''),
(529, 'TCS CRP 2018 Confirmation', 'Dear Students,</br>Kindly confirm your presence for TCS Interview Process by filling <a href=\"https://docs.google.com/forms/d/e/1FAIpQLScAZHRMI0b0LZoRHjHAUOQH8UMN9pS8fNUFnwNYEpeZxdP0XQ/viewform\" target=_blank\">Google Form</a>.</br>We will inform be sharing time and venue as soon as possible.', '2018-01-04', '02:33:19', ''),
(530, 'Interview Schedule: TCS CRP2018', 'Dear Students,</br> Your  are required to report as per below mentioned schedule and details: </br>\r\nVenue: TCS Yantra Park, Subhash Nagar, Thane 4000601</br>\r\nReporting Date: 06-01-2018</br>\r\nReporting Time: 1:00 PM</br> \r\nReporting area: Welcome Block</br> \r\nYou have  to carry the below mentioned mandatory documents.<ol> \r\n<li>TCS Application form printout</li>\r\n<li>College ID</li>\r\n<li>Resume</li>\r\n<li>Original mark sheets of Xth, XIIth, Diploma ( all semesters )</li>\r\n<li>Original mark sheets of Graduation/Post Graduation(all semesters)</li></ol></br>\r\nStudents are prohibited from carrying any form of media i.e pen drive, laptops, digital chips etc. \r\n', '2018-01-05', '01:26:46', ''),
(531, 'Rave Technology CRP', 'Dear Students,</br> We have started the registration for Rave Technology. </br> The deadline for registration is Sunday midnight, 07/01/2018.', '2018-01-06', '08:13:46', '91'),
(532, 'Multiplier Solutions CRP 2018', 'Dear Students,</br> Multiplier Solutions CRP 2018 is scheduled on 11-01-2018.</br> The reporting time is 10:00 AM sharp.</br> The venue is:</br>SIES Graduate School of Technology</br>Nerul, Navi Mumbai- 400 706, Maharashtra.', '2018-01-08', '10:39:55', ''),
(533, 'Vistex CRP 2018', 'Dear Students,</br>Vistex CRP 2018 for the position of  Associate Developer is scheduled on 17th January 2018 from 12:00 PM to 02:00 PM.</br>Written test will be conducted in the given period based on aptitude , c++, java, web & SQL.</br>The reporting time is 11:30 AM.</br>The venue is Thakur College of Engineering & Technology, Kandivali.</br>Carry your complete Placement Kit.</br>\r\nImportant Points for Students:<ul>\r\n<li>Selected candidate need to sign contract for two years, will also need to submit his Original Degree Certificate/ marktc sheets for two years as security.</li>\r\n<li>The starting pay will be Rs.25,000/- CTC (Take home would be nearly Rs.24,075/- after necessary deductions).</li>\r\n</ul>', '2018-01-08', '10:46:23', ''),
(534, 'Dolat Capital Market Private Limited CRP 2018', 'Dear Students,</br>Dolat Capital Market Private Limited CRP 2018 is scheduled on 16th January 2018 and 18th January 2018.</br>The reporting time for 16th January 2018 is 10:00 AM.</br>The complete schedule for two days is as follows:</br><ul><li>DAY 1 â€“ 16th January 2018 (Tuesday): PPT Presentation (30 mins) -> Written (Pen & Paper) Objective Test â€“ Based on C/C++ (45 mins) -> Evaluation of the Test -> Written (Pen & Paper) Aptitude Test (45 mins) -> Evaluation of the Test ->  Programming Test (Max 2.5 hours).</li><li>DAY 2 â€“ 18th January 2018 (Thursday): Depending on the result we would conduct the Face-to-Face Technical interviews of the candidates followed by the HR Round in Dolat Office.(We shall update about the timing).</li></ul>', '2018-01-08', '10:56:57', ''),
(535, 'Vistaar CRP 2018 Result', 'Dear Students,</br>Congratulations for getting selected in Vistaar. </br>Kindly share your experience letter in Placement Cell till Thirsday afternoon.</br>Once again congratulations to you.', '2018-01-09', '11:57:51', ''),
(536, 'TCS CRP 2018 Result', 'Dear Students,</br>Congratulations for getting selected in TCS. </br>Kindly share your experience letter in Placement Cell till Thirsday afternoon.</br>Once again congratulations to you.', '2018-01-09', '11:59:19', ''),
