(538, 'Geekay Infotech', 'Dear Students,</br>Geekay Infotech has started their registration.</br>The last date for registration is 14th January,2018 12PM.</br><a href=\"https://docs.google.com/forms/d/e/1FAIpQLSehNcfXGP2bOiKQm0-HlkY3LpMH-85fz1qY1n6HIptctD5QiA/viewform\" target=\"_blank\">Click here for more details and registration</a>.</br>Both the registartions i.e. College and Google form should be done.', '2018-01-12', '10:58:11', '92'),
(539, 'Vistex CRP 2018', 'Dear students who are participating in vistex test, visit their web site & get the brief idea about their organization.', '2018-01-14', '06:09:51', ''),
(540, 'TCS Hiring for 2017 Batch', 'Dear Students,</br>TCS is hiring for 2017 Batch. </br> We have started registration.</br> Both the registration is compulsory, <strong>College as well as company.</strong></br><a href=\"https://careers.tcs.com/static/MicroSites/BEOffCampus.html\" target=\"_blank\">For company registration and more details click here<a></br>And for college registration:', '2018-01-15', '04:01:38', '93'),
(541, 'Volunteers for Dolat Capital Market Pvt Ltd', 'Dear Students,</br>You have been selected as volunteers for Dolat Capital Market Pvt Ltd.</br>You have to be present tomorrow, Tuesday, 16th January, 2018 at 10:00 AM in 7th floor auditorium sharp.</br>Be in formals.', '2018-01-15', '10:17:58', ''),
