(543, 'Dolat Capital Interview', 'Dear Students,</br>\r\nYour Face to Face interview is schedule tomorrow i.e. 18th January 2018 at 04:00 PM in Dolat (Andheri) office. Given below is the venue details: </br>\r\nDolat Capital Market Private Limited</br>\r\nPeninsula Park, 9th Floor, 901,</br>\r\nBehind Bhagwati House, Near Hard Rock Cafe,</br>\r\nVeera Desai Road,</br>\r\nAndheri â€“ West, Mumbai â€“ 400 058.</br>\r\nNearest Landmark: Balaji Telefilms or Yashraj Studios (About 8 buildings away from Yashraj.)</br>\r\nCarry the hard copy of your resume and mark sheets (10th / 12th / Graduation) along with passport size photo. Also, prepare on C/C++, Data Structures, Algorithms and logically based puzzles for the interview. </br>\r\nContact Number: DID: 022 - 65564774 / 65564309; Board line: 022 - 66922046', '2018-01-17', '09:10:18', ''),
