(548, 'Hexaware CRP for 2017 Passout ', 'Dear Students,</br>\r\nHexaware is looking for Service Desk analyst(L1/L2) with below skillset.  </br>\r\nOnly shortlisted candidates would be called for Assessment Process.   </br>\r\nSalary will be 2 lacs with a 2 years bond.</br>\r\nRole: Service Desk analyst(L1/L2)</br>\r\nJob Location: Pune / Mumbai / Chennai </br>\r\nQualification: BE CS/IT/EXTC/Electronics</br>\r\nCriteria : 10th,12th 60% and BE 6.25 cgpa</br>\r\nSkill set required:</br>\r\nShould be flexible to work in 24/7 rotational shifts.</br>\r\nKnowledge of Active Directory, Outlook troubleshooting, Network troubleshooting, Windows Troubleshooting  (Preferable)\r\nKnowledge of ITIL Service Management best practices. (Good to have)</br>\r\nExcellent communication skills.</br>\r\nShould be able to understand client support requirements and respond</br>\r\nKey Responsibilities:</br>\r\nResolve / fulfill incoming Service Desk incidents and requests from internal staff</br>\r\nProvide IT support for many technologies (mostly Microsoft) to a wide user base</br>\r\nHandling incoming telephone calls, emails and self-service tickets in a customer friendly and professional manner</br>\r\nRecord all actions, conversations and work undertaken in the IT Service Management Tool (Service Now) Within Service Now, use the knowledge base for known errors and work around to aid diagnosis or resolution.</br>\r\nOther requirements :</br>\r\nMinimum qualifying criteria will be 60% through out.</br>\r\nCandidates will go thru an aptitude test.</br>\r\nThere will be a 2 year Service bond with the organisaiton.</br>\r\nDate of the drive : 23rd January 2018</br>\r\nVenue : Shantai auditorium,D.Y.Patil Educational Complex ,Akurdi</br>\r\nInterested students  should register on link on or before 20th  Jan 2018 by 2 pm.</br>\r\nRegistration Link:</br>\r\n<a href=\"https://goo.gl/forms/B6orMzIr3Cd7QzP62\" target=\"_blank\">Click here for registration</a>\r\n\r\n<strong> Both the registration are compulsory i.e. Company using above link and College using below link</strong>', '2018-01-18', '21:53:10', '94'),
