(554, 'Ixora Group', 'Dear Students,</br>\r\nIxora Group (<a href=\"www.ixora-group.com\" target=\"_blank\">www.ixora-group.com</a>) is looking for 10 full time employees who be based in its office in Mumbai.</br>\r\nRole- Engineer, help seniors to execute different consulting assignments.</br>\r\nSalary- INR 10,000/- per month Salary+ incentives. After 6 months, based on performance and commitment level get hike.</br>\r\nQualification- Passed out students of any Engineering stream.</br>\r\nInterested candidate should send a CV to placement.sakec@gmail.com with Subject as Ixora Group followed by your full name.', '2018-01-30', '23:15:27', '96'),
