(557, 'Byjus the Learning app Dream CRP 2018', 'Dear Students,</br> We have started the registration for Byjus the Learning app Dream CRP 2018.</br> The deadline is till tomorrow midnight</br> The details are as follows:</br>\r\nAcademic Qualification: B.E All Branch</br>\r\nBE  Cut-off Score: 6 CGPA </br>\r\n10th Score: Above 75%. </br>\r\nSelection Process: Group Discussion and Personal Interviews.</br>\r\nCTC : 9 lakhs (7 L fixed and 2L Performance Pay) </br>\r\nInternship: Mandatory for 2 months </br>\r\nStipend during Internship: Rs 25,000 per month. </br>\r\nCandidates should have: \r\n<ul>\r\n<li>1 copy of RESUME </li>\r\n<li>One sets of copies of your mark lists [10th/12th/Graduation] </li>\r\n<li>One passport size photograph attached to the resume </li>\r\n<li>College ID/Any other Photo ID</li>\r\n</ul>\r\n<b> Company Profile</b></br>\r\n<p align=\"justify\">Think and Learn Pvt Ltd is a pioneer in the global edtech segment and the parent company of Byjus the Learning app, the largest K12 learning app in the world with over 10million students learning with us. </br>A winner of the Deloitte Fastest 50 India Award for six years in a row and a winner of the Fastest 300 Asia Award for the last three years, the company has doubled its growth year on year. Byjus the Learning App provides lessons in math and science for students from grade 4 to 12 through formats such as videos, tests, quizzes, personalised learning paths and even games. There are programs also for competitive examinations like the JEE, NEET, CAT, GRE, GMAT and UPSC. </br>Byjus Learning App is a giant in the global edtech space with an array of investors valuing the company at thousands of crores. It was also the first Asian company to get the backing of Facebook founder Mark Zuckerberg. </br>Our employees can look forward to multiple benefit schemes starting from incentives, impact bonuses, travel incentives, health benefits and much more and if you are passionate about making India and the world Think and Learn through various platforms, modes and pedagogies then look no further!</p></br>\r\n<b>Job Title: Business Development Associate (BDA) </b></br>\r\n<b>Job Description</b></br>\r\n<p align=\"justify> You will begin in an individual contributors role, working in a team of go-getters to help spread the Byjus way of Learning in your city. You would be showcasing the unique Byjus way of Learning to students and parents and will be responsible for mentoring and sales in your designated zone.</p></br>\"\r\nSector: Sales, Marketing, Business Development. </br>\r\nLocations: Across India </br>\r\nPreferred Skill Sets: <ul>\r\n<li>Keen interest in education. </li>\r\n<li>Being interested in mentoring students. </li>\r\n<li>A knack for sales and positioning an idea. </li>\r\n</ul>', '2018-02-01', '01:57:21', '97'),
