(568, 'Regarding UFaber CRP 2018', '<strong>A brief about the company:</strong> </br>\r\n</br>\r\nÂ uFaber is Indiaâ€™s fastest growing EduTech companyÂ founded by alumni of IIT. uFaber has helped more than 100,000 students with high quality education. uFaber uses a unique pedagogy with personalised learning to every student to help clear some of the toughest examinations in the country. Comprising of an energetic, enthusiastic Â and creative team, uFaber has expanded within a short span of time to a team of 260 people and over 10 locations in India, growing further at a very aggressive rate on a weekly basis.\r\n</br></br>\r\n\r\n<strong>A brief about the role: </strong>\r\n</br></br>\r\nThe role of a Business Development Manager would require the following skills:</br></br>\r\n<ul>\r\n<li>Managerial Skills: Managing all ground operations needed for setting up and running the long stay properties </li>\r\n\r\n<li>Leadership Skills: Supervising associates and managing a team of folks under them</li>\r\n\r\n<li>Strong Communication and Street Smartness: Interacting with various students and showing smartness according to the scenario.</li>\r\n\r\n<li>Build relationship with the existing clients</li>\r\n\r\n<li>Work on client Acquisition.</li>\r\n\r\n<li>Candidate will be reporting directly to the sales head or equivalent position.</li>\r\n\r\n<li>Candidate will be required to understand the customer and figure out customer patterns</li>\r\n<li>Candidate will be working with the marketing team closely regarding lead generation and marketing patterns.</li>\r\n\r\n<li>Candidate should be diligent and efficient.</li>\r\n\r\n<li>Candidate is expected to be a self-starter and hungry for work</li>\r\n\r\n<li>Candidate should analyze his/her work and make necessary improvements.</li>\r\n\r\n<li>Candidate should have deep analytical skills.</li>\r\n\r\n<li>Coordination with the internal team.</li>\r\n\r\n<li>Candidate should have a great personality</li>\r\n\r\n<li>Candidate should have excellent communication skills, written and spoken</li>\r\n\r\n<li>Candidate should be able to handle pressure and work in fast-growing environment</li>\r\n\r\n<li>Candidate should be a quick learner</li>\r\n</ul>\r\n</br>\r\n<strong>Remuneration:</strong> CTC starting from 1.8 LPA to 3 LPA + Incentives between 30k to 50k per month + Different types of performance bonus nearly 4 LPA.\r\n</br></br>\r\n\r\n<strong>Location</strong> -Â FF A-006, Art Guild House, Pheonix market city, Kurla.\r\n</br></br>\r\n\r\n<strong>Work Timing</strong> -Â 9 hours required. (Mon to Sat, Alt Sat off)', '2018-03-03', '03:16:14', '103'),
