(575, 'AMAZON CRP 2018', 'Dear Students</br> We have started registration for AMAZON CRP for 2018 Batch.</br><strong>The deadline is 12th March 2018.</strong></br>You have to do both the registration i.e. Portal Registration and Google form.</br><a href=\"https://docs.google.com/forms/d/e/1FAIpQLSeajfSFfuu4x2Fj1a9u56ZVIHgWok_5H-M6LqT6yZ29LTzdCQ/viewform\" target=\"_blank\"> Link for Google form</a></br>In the above google form</br>College Name: Others</br>If your college name does not appear in the drop down *:Shah and Anchor Kutchhi Engineering College</br>College affiliated to University: University of Mumbai</br>TPO Name: Dr. Vinit C. Kotak</br>TPO Mobile Number: 9322211207</br>TPO Email: vinit_kotak@yahoo.com</br><strong>Note:You have to do both the registration i.e. Portal Registration and <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSeajfSFfuu4x2Fj1a9u56ZVIHgWok_5H-M6LqT6yZ29LTzdCQ/viewform\" target=\"_blank\">Google form</a>.</strong>', '2018-03-08', '05:35:12', '104'),
(576, 'Verdantis Campus Placement Drive', 'Dear All,</br>\r\nVerdantis Campus Placement drive on 17th March 2018 for BE 2017 batch .</br>\r\n<strong>Portal as well as Google form registration is must.</strong></br>\r\nJob Description -Software Implementation & QA Engineer </br>\r\n Role Type Full Time </br>\r\nWork Experience Fresher </br>\r\nQualification BE in I.T or Computer Science or Electronics or Electronics & Telecommunication </br>\r\nKnow how Software Development Concepts, Programming Concepts, Database Concepts Preferred Candidates Good communication skills Good logical and analytical skills Desired </br>\r\nSkills & Experience </br><ul>\r\n<li>Software Development Concepts </li>\r\n<li>Programming Concepts</li>\r\n<li>Database Concepts Preferred Candidates</li>\r\n<li>Good communication skills </li>\r\n<li>Good logical and analytical skills</li>\r\n</ul>\r\n Roles & Responsibility: </br>\r\n<li>The Software Implementation & QA Engineer will work closely with software product and would be responisble for implementation of product for clients and quality of product.</li>\r\n<li>Would work closely with Software Development, User Experience, Product Management teams to continually raise the bar for quality and performance of our products.</li> \r\n<li>Maintain & track defects or bugs </li>\r\n<li>Identify and document Test Scenarios and Test Cases. Maintain test suites</li>\r\n<li>Perform manual and automated testing</li>\r\n<li>Testing and Certifying Product Releases </li>\r\n<li>Manage different environmentes</li>\r\n<li>Additional responsibilities o Support product collateral creation â€“ user manuals, help sections etc. o Identify and effectively respond to issues reported by end users & clients</li>\r\n<li> Good communication skills </li>\r\n<li>Good logical and analytical skills </li>\r\n<li>Quick learner and good at application of concetps</li>\r\n<li>Enthusiastic and motiviated individual </li>\r\n<li>Flexible & innovative</li>\r\n<li>Collaborative & Good Team player </li>\r\n</ul>\r\nEligibility Criteria & Interview Process </br><ul>\r\n<li>Software Implementation & QA Engineer</li>\r\n<li>Eligibility Criteria: No Live KTs, Aggregate Percentage: 60% or or CGPA: 6.1</li>\r\n<li>Round Cut-off 1 Aptitude Test (Elimination Round) 20 out of 40 (50%) 2 F2F (Elimination Round) NA Company Profile</li>\r\n</ul>\r\n <strong>Website â€“ <a href=\"http://www.verdantis.com\" target=\"_blank\">http://www.verdantis.com</a></strong></br>\r\nJob timings: 11am-8pm</br>\r\nCTC : 3.5LPA Fixed</br>\r\nNumber of opening: 5</br>\r\n<strong>Please Note: Please inform all the students that there will be a bond of 18 months.</strong></br>\r\nVenue:</br>\r\nVerdantis Technologies Private Limited</br>\r\n61 Radius, 3rd Floor,</br>\r\nRoad No. 13, MIDC, Andheri East,</br>\r\nMumbai- 400 093.</br>\r\nTime: 12pm-3pm</br>\r\n Date: 17th March 2018</br>\r\nRegistration Link: <a href=\"https://docs.google.com/forms/ d/e/ 1FAIpQLSeLhGotoTUhomvGEHvnE2- mUraNVT75i6OPW_pIrWMcRekSUg/ viewform?c=0&w=1\" target=\"_blank\">REGISTER HERE</a>', '2018-03-15', '01:21:46', '105'),
(577, 'Hexaware CRP for 2017 Batch', 'Dear Students,</br> We have started registration for Hexaware CRP for 2017 Batch.</br><strong>Fill the <a href=\"https://docs.google.com/forms/d/e/1FAIpQLScrLODOXAMVu0Q1nbCv8tF7iZgPzuoTfMYKIpBL9iwsIwP2Hg/viewform?c=0&w=1\" target=\"_blank\">Google form</a> and do registration on Placement Portal also.</strong></br>For more details please read mail sent to you or <a href=\"https://docs.google.com/forms/d/e/1FAIpQLScrLODOXAMVu0Q1nbCv8tF7iZgPzuoTfMYKIpBL9iwsIwP2Hg/viewform?c=0&w=1\" target=\"_blank\">click here</a>.</br>', '2018-03-15', '09:08:57', '106'),
