(579, 'Zeus CRP 2018', 'Dear Students,</br>We have started registration for Zeus CRP 2018.</br>\r\n<strong>You have to do both the registration,Google Form and Placement Portal.</strong></br>\r\nAll the candidates should report 30 minutes before the respective time slots.</br>\r\nDetails of walk-in â€“</br><ul>\r\n<li>Registration start date â€“ 16th March 2018</li>\r\n<li>Registration end date â€“ 21st March 2018</li>\r\n<li>No. of batches â€“ 5</li>\r\n<li>Venue â€“ Zeus Learning, Tower B â€“ 1402, Peninsula Business Park, Lower Parel.</li></ul></br>\r\nRegistration link â€“ <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSfVxUD_Ssbxfd44s0XfE9A7Vpb6tdrL6OR4qQ-oxQd0XfALTQ/viewform\" target=\"_blank\">Zeus Walkins</a>\r\nNote â€“ Candidates who have appeared for any tests held by Zeus Learning in the past 12 months are not eligible for the test</strong>\r\n<strong>Last Date is 18th March 2018</strong></br> For more details see attchment.', '2018-03-16', '10:34:02', '108'),
