(582, 'Exadatum CRP 2018', 'Dear Students,</br>\r\nBased on the MAPIT Lite score, some of you have been shortlisted for the selection process by one of our respected clients, Exadatum .</br>\r\n<p align=\"justify\">You will receive an online test link on  23rd Friday 2018 10:00 AM  to your mail ID\'s, Please DO NOT open the test link on any mobile device for best performance as it is valid for a single usage only and will not function over repeated attempts thereafter.</p></br>\r\nOnline Test starts at 10:00 AM sharp i,e 23rd  Friday March\'18</br>\r\nExadatum Online test date: 23rd March\'18(Tomorrow)</br>\r\nOnline Test time : 10:00 Am(Friday)</br>\r\nJoining : Immediate</br>\r\nNote : You can give the test from Home\r\n</br><strong>You will require webcam for Test.</strong>', '2018-03-22', '19:26:21', '110'),
(583, 'MKCL - Job Opportunity for Project Trainees', 'Dear Students,</br> We have started the registration process for MKCL - Job Opportunity for Project Trainees.</br>\r\n<strong>You have to do both the registration i.e. College as well as Comapny.</strong></br>\r\n<a href=\"http://www.mkcl.org/#/careers\" target=\"_blank\">Click here for Company Registration.</a></br>', '2018-03-28', '02:02:37', '111'),
