(590, 'Nucsoft CRP 2018', 'Dear Students,</br> We have started registration for Nucsoft CRP 2018.</br>Both the registrations are compulsory i.e. Placement Portal and Google Form</br><strong>The deadline for registration is  13th April 2018 before 9.30 a.m.</strong></br>Google Form: <a target=\"_blank\" href=\"https://docs.google.com/forms/d/e/1FAIpQLSeEMj26px3d2URfrI1FA9a7NAizhVLtRpy16TLnEu1FAIkjew/viewform\"> Click here. </a></br>\r\nDrive Details:</br>\r\nSalary:</br>\r\nProfile: Software Engineer (Java / Dot Net / PL/SQL)</br>\r\n1.24 months Service Contract (for candidates after passing out)</br>\r\n2.Compensation varies from Rs. 2.24 L p.a. to Rs. 3.32 L p.a. based on the evaluation process</br>\r\nEligibility Criteria : 2018 Batch Computer, IT only</br>\r\nDegree Aggregate 6.5 CGPA</br>\r\n60% and above in 10th and 60% and above in 12th or Diploma</br>\r\nDrive Date:13th April 2018 ( REGISTRATION IS MUST TO ATTEND THIS DRIVE)</br>\r\nReporting time:9:30 AM</br>\r\nVenue:Ground floor Auditorium, Saraswati College of Engineering, Navi Mumabai.</br>\r\nDress Code:Formals</br>', '2018-04-11', '15:08:40', '115'),
(591, 'Advent Electronics International Pvt Ltd', 'Dear Students,</br> We have started the registration for Advent Electronics International Pvt Ltd.</br> Interested students can register</br>\r\nCompany Profile</br>\r\nWeÂ AdventÂ Electronics International Pte Ltd. Singapore / SAJ Electronics Pune is an Indian MNC having presence in India and ASEAN.</br>\r\nItâ€™sÂ been ourÂ continuous endeavor to value adds our CustomersÂ and Suppliers inÂ every phase of supply chain.</br>\r\nWe are having Sales Offices at Bangalore, Delhi, Hyderabad & Residential Representative at Chennai & Palakkad.Â </br>\r\nWe would like to offer posts of</br>\r\n1.Â Â Â Â Â Â Â JuniorÂ  Purchase Executive (ElectronicsÂ Â Engg)</br>\r\n2.Â Â Â Â Â Â Â Associate Technical Embedded Engineer (Electronics Engineering)</br>\r\nCandidates will undergo series of personal and technical interviews</br>\r\nInterview will be at pune.', '2018-04-12', '04:39:45', '116'),
(592, 'James Infinus Pvt Ltd', 'Dear Students,</br> We have started the registration for James Infinus Pvt Ltd.</br> <strong>Deadline is Tuesday, 17th April 2018 09:00 AM.</strong></br>\r\nCriteria</br>Branch: EXTC and Electronics with 5.75 CGPA and SSC and 12/Diploma 50 percent</br>\r\nInterview process as follows :</br>\r\n1. Written test.(Aptitude +Technical)</br>\r\n2. Group discussion (GD)</br>\r\n3. Personal & Technical Interview (PI)</br>', '2018-04-16', '03:54:30', '117'),
(593, 'TCS Post-offer Engagement Session', 'Dear Students,</br>\r\nTCS has organised the post-offer engagement session.</br>\r\nSession in 3 batches in different time slots, for more details check your mails. </br>\r\nDate: 20-April-2018 </br>\r\nVenue: Tata Consultancy Services, Yantra Park. Thane</br>', '2018-04-17', '06:06:12', ''),
(594, 'Meru CRP 2018', 'Dear Students,</br>We have started the registration for Meru CRP 2018.</br><strong>The deadline is  19th April, 2018 10:00 AM</strong></br>\r\nJob Description: Android and iOS Technology</br>\r\nCTC: 2.5 LPA</br>\r\n2 years of Agreement</br>', '2018-04-18', '06:54:06', '118'),
(595, 'Advent Google Form Registration', 'Dear Students</br> Fill the google form using below link as early as possible.</br>\r\n<a href=\"https://docs.google.com/forms/d/e/1FAIpQLScPyntQHWxFgMErqbv94A6co8z_W3fMoZn4sWdMAFd-8hqg5g/viewform\" target=\"_blank\">Google Form</a>', '2018-04-19', '11:20:58', ''),
(596, 'Hexaware requirement for IMS', 'Dear Students</br>\r\nWe have started the registration for Hexaware requirement for IMS.</br>\r\n<strong>Deadline for Registration is 21st April 2018.</strong></br>\r\nCriteria: BE Computer / IT</br>\r\n<b>Technical Skills (Desirable)</b></br>\r\n-   Working knowledge in Oracle</br>\r\n-   Able to write SQL queries</br>\r\n-   Able to troubleshoot problems in multiple environments</br>\r\nThe opportunity for IT Support as part of our Infrastructure management Team (IMS).</br>\r\n The Opportunity does not include development and is into IT Support. </br>\r\nThey have requirement in Chennai/Mumbai and Pune.</br>\r\nThere is a 2 Year Bond. </br>\r\nSalary: 2 lacs.</br>\r\n<b>Other Requirements:</b></br>\r\nGood Communication â€“ Both Oral and Written.</br>\r\nAbility to multi-task and work towards tight deadlines</br>\r\nTeam player who is ready to take on issues and problems and manage them single headedly if need be.</br>\r\nSense of urgency when handling production issues impacting business users/clients</br>\r\nReady to work in shifts (including night shifts) and weekends</br>\r\nInterested Students should send a updated resume to placement@shahandanchor.com with Subject as Hexaware_IMS_Student_Name_Reg_no</br>', '2018-04-19', '11:28:57', '119'),
(597, 'Reliance Jio CRP', 'Dear Students,</br>\r\nWe have started the registration for Reliance Jio CRP.</br>\r\n<strong>The Deadline for registration is 20th April 2018 10:00 PM</strong></br>\r\nDrive is scheduled tomorrow at 09:00 AM at following venue and registration is compulsory.</br> \r\nYou need to  carry a passport size photograph along with a copy of your updated CV and college ID card for identification.</br>\r\n Venue</br>\r\nBOND Area,</br>\r\nTC 23,B block,Ground Floor,</br>\r\nReliance Corporate Park,</br>\r\nMIDC Industrial Area,Ghansoli,</br>\r\nNavi Mumbai,</br>\r\nMaharashtra 400701.', '2018-04-20', '03:51:36', '120'),
(598, 'Bank of America', 'Dear Students</br>\r\nWe have started registration for Bank of America</br>\r\nRequirements:good voice skills/verbal communication and willing to work in Night Shifts at Gurugram.</br>\r\nInterested students should send updated resume to placement@shahandanchor.com before today 20th April 2018 8 pm. ', '2018-04-20', '08:00:26', '121'),
(599, 'Reliance Jio Details', 'Dear Students</br>\r\nFind below few additional details:</br>\r\n1. Interview Location: Cabin no - Ground Floor, B Block, Building Number TC23, Reliance Corporate Park, Thane Belapur Road, Ghansoli, Navi Mumbai â€“ 400706.</br>\r\n2. Contact: Ruchi Shetty (+919082618045), Sanchi Bhatia (+91908261820), Akshata Jabade (+918454043131).</br>\r\n3.Schedule: 9:00 onwards 21st April 2018</br>\r\n4.Entry from: Main Gate(Gate House),RCP.</br>\r\n5. Visitor Pass to be collected from Gate House by showing your college ID Card and original photo ID proof (Driving license/Aadhaar Card/Passport)to Mr. Kalpesh Kulkarni or Mr.Karan Mankar.</br>\r\n6.Kindly inform the candidates to carry a print out of their updated CV along with your photograph.</br>\r\n7. Visitor Pass to be returned at the end of the day without fail.', '2018-04-20', '12:42:46', ''),
(600, 'Dhoot Transmission CRP', 'Dear Studentss,</br>\r\nWe have started registration for Dhoot Transmission CRP.</br>\r\n<strong>The last date of registration is 21st April 2018 Midnight</br>\r\nYou have to do both the registration, company as well as Placement Portal.</br>\r\nBoth the registrations are must.</br></strong>\r\nDhoot Transmission Pvt ltd is leading  manufacturing company in the filed of wiring  Harness , sensors and connectors based in chakan , Pune . It has many giant clients i.e. Bajaj Auto , Suzuki, Eicher, volvo and many more</br>\r\nJob Description : Post: Employee Trainee</br>\r\nQualification: BE  Electronics and EXTC</br>\r\nStipend: 9000/- per month + attendance bonus upto 1000</br>\r\nFacility: Transportation free</br>\r\nProfile: have to worked on production Assembly line</br>\r\nGoogle Form Link: <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSfIw9Lri0Sd--EnJwkklxRu53UfZ9_FfFFIPLaqHJ4as0Z6ug/viewform\" target=\"_blank\">Click here</a>', '2018-04-20', '12:54:01', '122'),
(601, 'Syntellect CRP 2018', 'Dear Students,</br> We have started registration for Syntellect CRP 2018.</br>Both the registration you have to do, one for College Placement Portal another for Company by visiting registration link given below.<strong>The Deadline for registration is 31st March 2018.</strong></br>\r\nWe are pleased to share the following eligibility criteria for Syntellect 2018 campus recruitment program:</br>\r\n<ul>\r\n<li>2018 Full Time graduates: ONLY from recognized universities</li>\r\n<li>Courses & Streams : B.E Computer Science, Information Technology</li>\r\n<li>Minimum 60% in SSC (X), HSC (XII), Graduation (UG) and Post- Graduation (PG) [All Semesters Aggregate]</li>\r\n<li>Backlog: There should be NO current backlog(s)</li>\r\n<li>Education Break: Maximum of 1 year break in education is allowed (from X/SSC to Highest Qualification)</li>\r\n<ul></br>\r\nPrerequisites<ul>\r\n<li>Good written and verbal English skills</li>\r\n<li>Flexible to work in any shift (Morning / Afternoon / Night) / Rotational Shift</li>\r\n<li>Job Location: Pune/ Mumbai / Chennai â€“ Syntel reserves the right of allocation</li>\r\n</ul></br>\r\n<strong><a target=\"_blank\" href=\"http://tests.mettl.com/drive/Syntellect-2018-BE-MCA-Candidate-Registration-Form/\">Candidate Company Registration Link</a></br>\r\nThe registration activity will close on 31st March 2018. Therefore request you to complete this activity on or before the said date. It is advisable to avoid last minute rush.', '2018-04-24', '02:58:20', '99'),
(602, 'Welcome !!!', 'Dear Students of Batch 2019,</br> Welcome to Training and Placement Department</br> From now onward you will receive most of the Placement related messages through the Portal.</br> To register for event event or Company similar message will be given to you.</br>\r\nFor registration on Portal at end of message you will find <strong> Click here </strong>  message where you have to click and register before the specified deadline.</br>\r\nIn some cases there can be dual registration for example Placement Portal like mentioned above,  and Google form or Company whose link will be provided in message. In such cases both the registrations are compulsory.</br>\r\nOnce again we welcome and advice you to follow the rules and procedure mentioned in above message.', '2018-04-25', '07:11:13', ''),
(603, 'NPCI SUMMER INTERNSHIP', 'Dear Students,</br>\r\nTraining and Placement Department is promoting the Summer Interns Hiring at NPCI.</br>\r\nOnly interested candidate shall apply.</br>\r\n<strong>The deadline for registration is 25th April 2018 05:00 PM.</strong></br>\r\nRegistred candidate should also mail their Resume to placement@shahandanchor.com without fail else you will not be considered.</br>\r\nEligibility:</br>\r\nSSC: 75 percent</br>\r\nHSC / Diploma : 65 percent</br>\r\nBE: 6.75 CGPA</br>\r\nBranch : Computer Engineering and Information Technology</br>\r\nStipend:Rs. 7000/-</br>\r\nProject duration shall be from 2 to 3 months (depending on NPCI requirement).</br>\r\nThe Candidate,\r\n<ul>\r\n<li>Shall fit the educational criteria & shall be ok with the mentioned stipend above.</li>\r\n<li>Shall agree to work with NPCI for the given project as per the NPCI policy.</li>\r\n<li>Shall agree to join NPCI in case Pre Placement Offer - PPO is given.</li>\r\n<li>Shall have no issues with 2 years Bond of NPCI if they join NPCI as an employee after completion of their degree.</li>\r\n</ul>\r\nProcess of hiring Summer Interns (SI):\r\n<ul>\r\n<li>Shortlisting as per eligibility.</li>\r\n<li>Psychometric Test followed by PI.</li>\r\n<li>SI Selection & joining at NPCI.</li>\r\n<li>Project review by the panel after completion of the project.</li>\r\n<li>Performance based selection.</li>\r\n<li>Best performers shall be offered PPO.</li>\r\n<li>Draft offer release.</li>\r\n<li>The candidate received PPO shall be joining after completion of their degree/course.</li>\r\n</ul>\r\n<strong>The deadline for registration is 25th April 2018 05:00 PM.</strong></br>\r\nRegistered candidate should also mail their Resume to placement@shahandanchor.com without fail else you will not be considered.</br>', '2018-04-25', '01:28:25', '123'),
(604, 'Regarding NPCI', 'Dear all send resume also on placement@shahandanchor.com ', '2018-04-25', '05:46:05', ''),
(605, 'Regarding Summer Internship Project at NPCI', 'Dear Students,</br>\r\nYou have been shortlisted for Summer Internship Project at NPCI.</br>\r\n<p align=\"justify\">\r\nNational Payments Corporation of India is an umbrella institution for all the retail payments in the country. The core objective is to consolidate and integrate the multiple systems with varying service levels into nation-wide uniform and standard business process for all retail payment systems. The other objective is to facilitate an affordable payment mechanism to benefit the common man across the country and help financial inclusion. </br> For more detailed information on the Vision, Mission, Objectives and Products & Services, you can log on to <a href=\"http://www.npci.org.in/\" target=\"_blank\">NPCI</a></br>Currently we have been working aggressively with government on PMJDY (Pradhan Mantri Jan-Dhan Yojana) wherein Rupay Debit Cards are being issued to all the New Account holders. </br>We have a vibrant and young workforce of 500+ employees working on Mission Touching every Indian with one or other payment system by 2020</br>\r\n</p>\r\nPlease find below details for the Assessment Questionnaire:</br>\r\n1.      Assessment Questionnaire (AQ) is personality based Assessment.</br>\r\n2.      AQ is time bounded so kindly complete within the stipulated time which will be displayed during the Test.</br>\r\n3.      Must be completed in one go (once accessed, must be completed without pauses).</br>\r\n4.      No Negative Marking.</br>\r\n5.      Avoid connectivity issues.</br>\r\n6.      URL to access the AQ: <a href=\"http://www.identifythebest.com/globalgateway\" target=\"_blank\">http://www.identifythebest.com/globalgateway</a></br>\r\n7.      Username and Passwords will be provided to you while test.</br>\r\n<strong>Test will be conducted on 27th April 2018</strong>Note: You will be eligible to appear for next round only on successful completion of the above questionnaire.</br>', '2018-04-26', '11:46:50', ''),
(606, 'Test message', 'Test message during viva', '2018-04-27', '00:47:34', ''),
(607, 'Navkar Enterprise', 'Dear Students,</br> If you have applied for Navkar Enterprise and received some message or email regarding it, then register here.</br>\r\nCampus drive which is schedule on 3rd MAY 2018 at 1PM Venue CR1 Grnd flr DBIT Mumbai .', '2018-05-02', '10:18:13', '124'),
(608, 'DXC Technology', 'Dear Students,</br> \r\nWe have started registration for DXC Technology.</br>\r\n<strong>It has two registration i.e. Placement Portal and Google form. Both the registrations are compulsory.</strong></br>\r\n<strong>The deadline for registration is 8th May 2018 10 AM</strong></br>\r\nGoogle Form : <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSdu2bOnEGffgVIZowafEKJ1nGANb32MOQboUSP20hN2prfMvg/viewform\" target=\"_blank\"> Click Here</a> </br></br>\r\nDXC Technology (NYSE: DXC) is the worldâ€™s leading independent, end-to-end IT services company, helping clients harness the power of innovation to thrive on change. Created by the merger of CSC and the Enterprise Services business of Hewlett Packard Enterprise, DXC Technology serves nearly 6,000 private and public sector clients across 70 countries. The companyâ€™s technology independence, global talent and extensive partner alliance combine to deliver powerful next-generation IT services and solutions. DXC Technology is recognized among the best corporate citizens globally. For more information, visit www.dxc.technology.Â </br>\r\nJob Profile</br>\r\nAs a Trainee, the candidate will initially be trained on required technologies as per the business need. In addition, the candidate will also be oriented in the respective domain and work with the Project Leads and subject matter experts assigned.</br>\r\nEligibility Criteria :-Â </br>\r\nâ€¢Â Â Â  60 % throughout (10th, 12th, Graduation and Post Graduation should be 60% and above)</br>\r\nâ€¢Â Â Â  No current backlogs/arrears at the time of evaluation process as well as joining</br>\r\nThe process will consist of:</br>\r\n1.Â Â Â  Aptitude and Functional Written TestÂ Â Â Â </br>\r\n2.Â Â Â  Communication RoundÂ Â Â  Â Â </br>Â Â \r\n3.Â Â Â  Functional Interview</br>\r\n4.Â Â Â  HR InterviewÂ Â Â Â Â Â Â Â Â Â Â Â </br>\r\nEach round of assessment will be an elimination round.</br>\r\nCampus Recruitment Drive Date and Time:-Â 30th May 2018 at 8.30AM</br>\r\nVenue :-Â </br>\r\nSt. John Technical Campus</br>\r\nVill. Vevoor, Manor Road, PalgharÂ  ( E )</br>', '2018-05-02', '10:30:44', '125'),
(609, 'Regarding Summer Internship Project at NPCI', 'Dear Students,</br>\r\nCongratulations you are shortlisted for Interview round at NPCI Summer Internship.</br>\r\nSend your Skype ID for Personal Online Interview which will be scheduled mostly in next week.</br>\r\nAlso inform you are ready for relocation or not?</br>\r\nEligibility:</br>\r\nSSC: 75 percent</br>\r\nHSC / Diploma : 65 percent</br>\r\nBE: 6.75 CGPA</br>\r\nBranch : Computer Engineering and Information Technology</br>\r\nStipend:Rs. 7000/-</br>\r\nStudents relocating for internship shall get 15000/- per month stipend.</br>\r\nProject duration shall be from 2 to 3 months (depending on NPCI requirement).</br>\r\nThe Candidate,</br>\r\nShall fit the educational criteria & shall be ok with the mentioned stipend above.</br>\r\nShall agree to work with NPCI for the given project as per the NPCI policy.</br>\r\nShall agree to join NPCI in case Pre Placement Offer - PPO is given.</br>\r\nShall have no issues with 2 years Bond of NPCI if they join NPCI as an employee after completion of their degree.</br>\r\nProcess of hiring Summer Interns (SI):</br>\r\nShortlisting as per eligibility.</br>\r\nPsychometric Test followed by PI.</br>\r\nSI Selection & joining at NPCI.</br>\r\nProject review by the panel after completion of the project.</br>\r\nPerformance based selection.</br>\r\nBest performers shall be offered PPO.</br>\r\nDraft offer release.</br>\r\nThe candidate received PPO shall be joining after completion of their degree/course.</br>', '2018-05-03', '11:36:28', ''),
(610, 'Capgemini Recruitment Drive', 'Dear Students,</br>\r\nWe have started Capgemini Recruitment Drive registration.</br>\r\nIt has two registration process i.e. Placement Portal and Google Form.</br>\r\nGoogle Form :<a href=\"https://docs.google.com/forms/d/e/1FAIpQLScWjQ-vptbFwKXG9v2LLhFTQeUiROiomO0qorXPcxIBxF9hPA/viewform?c=0&w=1\" target=\"_blank\"> Click Here </a></br>\r\n<strong>The deadline for Registration is till midnight of 4th May 2018.</strong></br>\r\nDrive Details:</br>\r\nDate:    5th May 2018 ,Saturday</br>\r\nVenue: Assembly Hall ,Ground Floor</br>\r\nSFIT,Borivali, Mumbai</br>\r\nReporting Time: 8.00 am</br>\r\nDocuments required:</br>\r\nÃ˜  Updated CV - 2 no</br>\r\nÃ˜  Photographs - 3 no</br>\r\nÃ˜  All Educational Certificates photocopies</br>\r\nÃ˜  All semester mark sheets or consolidated mark sheets and Provisional or Degree Certificate</br>\r\nÃ˜  Passport or Passport Application Receipt (Optional)   (ALL DOCUMENTS ARE MANDATORY )</br>\r\nThe eligibility criteria for registration are:</br>\r\n10th & 12th - Minimum 60 </br>\r\nAggregate of 8 Semester 6.75 CGPA </br>\r\nNo Backlogs but a gap of one (1) year post 12th grade before commencement of engineering degree is acceptable.</br>\r\nLocation of deployment: Operating Locations of Respective Organisation </br>\r\nGraduating Year : 2017 (SUMMER PASSED OUT ONLY)</br>\r\nEntry Assessment â€“ These students would undergo the following steps of selection </br>\r\nAptitude Test and WET</br>\r\nPseudo code Test</br>\r\nHR Interview</br>\r\nAttending pre-screening is mandatory. Without admission letter candidates will not be eligible to attend final rounds.</br>\r\nAadhar Card Number or PAN Card number either of one is mandatory. Candidates will be rejected for incorrect information.</br>', '2018-05-04', '05:04:31', '126'),
(611, 'Reliance Jio Interview', 'Dear Students,</br>\r\nYou are invited for an interview at Reliance JIO on 30th  May 2018 , 9:00 a.m.</br>\r\nFor more details please refer attachment.', '2018-05-08', '05:38:31', ''),
(612, 'Graphene Media', 'Dear students we have started registration for Graphene Media.  For more details please see attachment. The deadline for registration is 10th May 2018 till 2pm. Interested candidate should send resume on placement@shahandanchor.com without fail.', '2018-05-08', '03:15:28', '127'),
(614, 'NSEIT Welcome Onboard Meet', 'Dear student,</br>\r\n NSEIT has arrange WELCOME ONBOARDÂ MEET at their office in Mumbai onÂ 29 May 2018 - Tuesday for selected students. Email invite also sent to you.</br>\r\nGo through mail and do the needful.', '2018-05-10', '23:42:41', ''),
(615, 'Ixora Tech Registration', 'Dear students we have started registration for Ixora Tech.</br> The deadline for registration is Monday 14th May 2018 10:00AM sharp. Interested candidate should register as well as send resume to placement@shahandanchor.com without fail.\r\n</br>\r\nJob description- Work with our clients for product development activities- specially related to IOT and digital devices etc.\r\n</br>\r\nCriteria - Students should very sincere, should know how to write mail and do healthy  communication to the client.\r\n</br>\r\nJob Location- Goregaon, Mumbai\r\n</br>\r\nSalary- Negotiable, initial offer INR 10,000 per month plus incentive\r\n</br>\r\nAbout Company- In October 2015, promoted by Ranen, an industrious IIM grad, Ixora Tech Consulting is a provider of Business, Process consulting and Analytics solutions to organizations. We work with companies across multiple industry verticals solving business problems. We have expertise and experience across multiple verticals such as Pharma, Healthcare, Retail, BFSI, Auto, Agri, Manufacturing, Education, Utility and many more. Also helping many higher educational institutes for Experimental Research Plan, Research Infrastructure Development, Intellectual Property Rights Strategy, Product Incubation and Technology Business Incubation.', '2018-05-12', '13:25:31', '128'),
