(618, 'Regarding meeting with The Placement Team', 'Dear Mr. Sahil Pathak</br>\r\nGreetings from Shah and Anchor Kutchhi Engineering College !!!</br>\r\nYou are requested to meet any of the Placement Team Member after your last theory paper examination without fail i.e. on 28th May 2018.</br>\r\nThanks & Regards,</br>\r\nPlacement Team</br>\r\nSAKEC', '2018-05-17', '02:13:12', ''),
