(623, 'KONGSBERG DIGITAL CRP 2018', 'Dear Students,</br>\r\nWe have started registration for KONGSBERG DIGITAL.</br>\r\n<strong>The deadline for registration is 22nd May 2018.</br> There are two types of registration i.e. Placement Portal and Company Link.</br>Both are compulsory.</strong>\r\nJob Position: Trainee Software Engineer</br>\r\nCompany Profile: <p align=\"justify\">Kongsberg Digital is a provider of next generation software and digital solutions to customers within maritime, oil & gas and renewables & utilities.The Kongsberg Group has around 7700 employees located in around 70 offices in more than 25 countries around the world.</p></br>\r\nEligibility : BE  with 65 percent (7.25 CGPA) throughout academics.</br>\r\nMain tasks and responsibility :\r\n<ul>\r\n<li>Understanding and analyzing project requirements and translating it into specifications and programming deliverables.</li>\r\n<li>Working closely with analysts, designers, product managers and clients to develop new product as well as to enhance existing applications.</li>\r\n<li>Developing, Testing and debugging the product in controlled and real situations.</li>\r\n</ul></br>\r\n<strong>Salary : INR 4.2 LPA</strong></br>\r\nSelection Process: Written Aptitude test, Technical Interview â€“ 1, Technical Interview â€“ 2, Group Discussion, Personal Interview. </br>\r\nSelected candidates will go through a training program for 6 months before working on hands-on projects.</br>\r\n<strong>The deadline for registration is 22nd May 2018.</br> There are two types of registration i.e. Placement Portal and Company Link.</br>Both are compulsory.</strong>\r\nCompany Link: <a href=\"https://www.freshersworld.com/jobs/company/kongsberg-digital-419214\" target=\"_blank\">Click here for Company Registration.</a>', '2018-05-19', '01:44:33', '132'),
(624, 'Course to be Register in NPTEL and Spoken Tutorial', 'Dear Student,</br>\r\nAs per discussion during Placement Orientation Program held on 5th April 2018, we would like to remind you that You have to register for the various NPTEL and Spoken Tutorial Courses. The list of courses is attached. Refer the attachment and do the needful as early as possible.\r\n</br></br>\r\nThanks and Regards,</br>\r\nPlacement Team</br>\r\nSAKEC</br>', '2018-05-19', '06:18:07', ''),
(626, 'Thirdware Technology Solutions Limited', 'Dear Students,</br>\r\nWe have started the registration for Thirdware Technology Solutions Limited.</br>\r\nThe deadline is 22nd May 2018.</br>\r\nThirdware is a leading IT Services company in the areas of ERP and Business Intelligence services catering to the Top Automotive customers across India and N. America. </br>\r\nPosition: Graduate Engineerâ€‹sâ€‹</br>\r\nWork Hours: 9:30 am â€“ 6:30 pm</br>\r\nRecruitment Process: </br>\r\n1.Written Test</br>\r\n2. Group Discussion & Interview</br>\r\nJob Location:â€‹Thirdware Technology Solutions Limited, SEEPZ Andheri East, Mumbaiâ€‹</br>\r\nSalary: 3.5L pa</br>\r\nJob description: The selected applicants will be deployed in the areas of MFG or PRO programming, consulting or in the areas of EPM (Enterprise Performance Management) based on the business needs. All selected applicants will be provided initial training before deployment.</br>', '2018-05-22', '03:33:19', '133'),
