(641, 'Opportunity for students to represent Internshala in college campus', 'Dear Student</br>\r\n<strong>It has two registration i.e. One on Portal and another on Internshala Link.</br>The last date to apply - 6th June 2018.</strong>\r\nInternshala Link: <a href=\"https://internshala.com/isp/?utm_source=ISP10&utm_medium=tnp_30k_reminder\" target=\"_blank\">Click Here</a></br>\r\nInternshala has launched the tenth edition of our flagship program - Internshala Student Partner (ISP 10). This program is designed to provide students with valuable leadership experience and strengthen the internship culture of in college.</br>\r\nAbout the program: Selected students (ISPs) will represent Internshala in our college and will Ã¨mbark on a leadership journÃ¨y like none other! This will be a huge opportunÃ¬ty for you to develop their marketing and communication skills. Students will also receive a certificate of appreciation at the end of the program as well as performance-based incentives  (we have given financial rewards worth INR 60 lacs+ in our previous editions). </br>\r\nThere are multiple positions from college. </br>\r\nInterested students can apply here - internshala.com/i/isp10 (applications have already begun).</br>', '2018-06-01', '01:59:33', '137'),
