(645, 'Reliance Jio Infocomm Ltd. Mumbai CRP 2018 Batch', 'Dear Student</br>\r\nReliance is organizing a Mega Drive at Dr. J. J. Magdum College of Engineering, Jaysingpur, Kolhapur</br>\r\nIt has two registration i.e. Portal and Google Form Registration</br>\r\nDeadline is till Sunday 3rd June 2018</br>\r\n<a href=\"https://docs.google.com/forms/d/e/1FAIpQLSetlaj52ywq0YWDRkTabn9riVALy2KS4TwnXBp8K2Bu-vCJLA/viewform\" target=\"_blank\">Click here for Google Form Registration</a>\r\nDate- 04th June 2018</br>\r\nTime- 9:00 am Sharp (Late comers not allowed).</br>\r\nVenue- Dr. J. J. Magdum College of Engineering, Jaysingpur.</br>\r\nThe selected candidates will get an opportunity to work on various products & services of Jio.  You will also get an opportunity to work on the latest technologies such as Big Data, Machine Learning, Block chain, Artificial Intelligence, Android, iOS & Web development.</br>\r\nSelection Process :\r\n</br>Presentation\r\n</br>Round 1 â€“ Group Discussion\r\n</br>Round 2 â€“ Aptitude test online\r\n</br>Round 3 â€“ Technical Interview-I\r\n</br>Round 4â€“ Technical Interview No.II\r\n</br>Salary : 3.5 Lacs /Annum\r\n</br>Documents Required (Original and photocopies) :\r\n</br>1)SSC Marksheet\r\n</br>2)HSC / Diploma Marksheet\r\n</br>3)Graduation / Post Graduation or other mentioned degrees all years mark sheets\r\n</br>4)Photo ID proof (Licence/College ID/Passport etc.)\r\n</br>5)2 photographs\r\n</br>6)Resume', '2018-06-01', '11:45:56', '140'),
(646, 'Swachh Bharat Internship', 'Dear Student,</br>\r\nTraining and Placement Department is promoting Swachh Bharat Internship. It is 100 hour experiential internship program would require the candidate to visit one or more villages and conduct activities of their choice to contribute to the cause of rural sanitation in India.</br>\r\nRewards and Recognition:</br>\r\nReward and Recognition section to be redesigned.</br>\r\nAll participants will be given a Swachh Bharat Internship Certificate on completion of their internship and its approval by the parent institution.</br>\r\n2 curriculum credits will be given to interns whose internship reports are found eligible to get credits by parent institution.</br>\r\nThe Best 3 interns/ teams will be recognized at college, university, state and national levels. Their awards are as follows:</br>\r\nCollege Level: Shields / cups and special certificates</br>\r\nCash Awards</br>\r\nCash Awards in addition to certificates</br>\r\nUniversity Level: Rs 30,000, Rs 20,000, Rs 10,000 along with appropriate certificates</br>\r\nState Level: Rs 50,000, Rs 30,000, Rs 20,000 along with appropriate certificates</br>\r\nNational Level: Rs 2 lakh, 1 lakh, Rs 50,000 along with appropriate certificates</br>\r\nFor more details and registration: <a href=\"https://sbsi.mygov.in/about-internship/\" target=\"_blank\">Click Here</a>', '2018-06-02', '01:22:01', ''),
