(663, 'Clover Infotech CRP for 2017 Batch', 'Dear Student</br>\r\nClover Infotech is  currently hiring freshers.</br>\r\nSkill/Technology - VBA (Visual Basic for Applications)</br>\r\nCriteria</br>\r\n- Candidates should have good communication skills</br>\r\n- strong knowledge in MS Excel</br>\r\n- Ready to travel anywhere in Mumbai</br>\r\n- ready to relocate anywhere in India</br>\r\n- should be ready to work in Bond</br></br>\r\nInterview Date - 11th June 2018</br>\r\nTime - 10:00 AM</br>\r\nAttire - Formals well groomed appearance</br>\r\nDocs required -</br>\r\n1. Updated Resume</br>\r\n2. Passport size photo</br>\r\n3. PAN card copy</br>\r\nContact Person - Karan Rathod</br>\r\nVenue Details -</br>\r\nClover Infotech, 2nd floor,</br>\r\nDhana Singh Processors Bldg, VazirGlassLane,</br>\r\nJ.B\r\nNagar,</br>\r\nKotak Bank </br>\r\nAndheri East</br>\r\nLandmark - Near J.B. Nagar Metro Station and Elegant Business Park</br>\r\nMumbai - 400059</br>', '2018-06-10', '05:09:57', '146'),
(664, 'Godrej CRP Update', 'Dear Student</br>\r\nDrive for Godrej InfoTech Ltd would be held on 15th June, 2018 within the Godrej Premises</br>\r\nGodrej will invite you via mail latest by 11th June, 2018.</br>\r\nStay active on your Email Ids.', '2018-06-10', '05:24:04', ''),
(665, 'UTC Aerospace CRP', 'Dear Student</br>\r\nWe have started registration for UTC Aerospace.</br>\r\nIt has dual registration process i.e. Placement Portal and Company Link.</br>\r\nFor more information and Company registration <a href=\"https://www.firstnaukri.com/careers/customised/landingpage/utv/28may2018.html\" target=\"_blank\">Click here.</a>', '2018-06-10', '05:44:11', '147'),
(666, 'Siyana Info CRP', 'Dear Student</br>\r\nWe have started registration for Siyana Info.</br>\r\nIt has dual registration process i.e. Placement Portal and Company Link.</br>\r\nFor more information and Company registration <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSfp0b-qi46hvLHmtn9WeAUhEMjpfOdVk5ZrgeVUmc-C5zpS1g/viewform\" target=\"_blank\">Click here.</a>', '2018-06-10', '06:00:40', '148'),
(667, 'Interview in Thirdware Technology', 'Dear Student</br>\r\nYou have been shortlisted for the interview round in Thirdware Technology.</br>\r\nIt is schedule on Monday 11th June 2018 at 11 AM in St Francis Boriwali.</br>\r\nKindly present before time in formal and carry your complete placement kit along with the college ID.', '2018-06-10', '06:16:29', ''),
(668, 'Resume Writing Training Session', 'Dear Student,</br>\r\nTraining and Placement Department has scheduled a Session on <b>Resume Writing</b> on Wednesday, 13<sup>th</sup> June, 2018 at 10:00 AM.</br>\r\nAll of you have to present for the session at 09:45 AM sharp in formals at 7<sup>th</sup> Floor Auditorium.</br>\r\nRegistration and Attendance is mandatory.</br>\r\nCriteria: All Branches having CGPA greater than or equal to 6.80</br>\r\n<strong>Deadline for Registration is till 12<sup>th</sup> June, 2018.</strong></br>', '2018-06-11', '04:42:43', '149'),
(669, 'Group Discussion Training Session', 'Dear Student,</br>\r\nTraining and Placement Department has scheduled a Session on <b>Group Discussion</b> on Wednesday, 13<sup>th</sup> June, 2018 at 01:00 PM.</br>\r\nAll of you have to present for the session at 12:45 PM sharp in formals at 7<sup>th</sup> Floor Auditorium.</br>\r\nRegistration and Attendance is mandatory.</br>\r\nCriteria: All Branches having CGPA less than 6.80</br>\r\n<strong>Deadline for Registration is till 12<sup>th</sup> June, 2018.</strong></br>', '2018-06-11', '04:50:31', '150');
INSERT INTO `message` (`mail_id`, `subject`, `message`, `send_date`, `send_time`, `company_id`) VALUES
(670, 'Amazon CRP 2018', 'Dear Student,</br>\r\nWe have started registration for AMAZON for role of Linux and Hardware Engineer Trainee.</br>\r\nKindly review the details and register on or before 02:30 pm on 13th June 2018</br>\r\nIt has two different registration i.e. Placement Portal and Company Google Form</br>\r\nBoth registrations are compulsory</br>\r\nFailure to anyone registration can discard your chances</br>\r\nCompany Google Form Link:\r\n<a href=\"https://docs.google.com/forms/d/e/1FAIpQLSere2Q9hXubcHCnoN3S64X7kxFUeprq15Li5zTdtvyQ2HJwbA/viewform?fbzx=4178702346428913000\" target=\"_blank\"> Click here </a></br>\r\nDeadline is 13th June 2018 on or before 02:30 PM.', '2018-06-12', '11:47:09', '151'),
(671, 'Meru CRP Written Test', 'Dear Student</br>\r\nYour written test for Meru is scheduled on 14<sup>th</sup> June 2018 at 10 AM.</br>\r\nReporting venue is 4<sup>th</sup> floor auditorium.', '2018-06-12', '11:57:30', ''),
(672, 'Congratulations !!!', 'Dear Student</br>\r\nCongratulations for getting placed in Thirdware Technology.</br>\r\nKindly mail your updated resume to placement@shahandanchor.com as early as possible.</br>\r\nSubmit your experience letter till Friday and congratulations once again.</br>', '2018-06-13', '04:37:59', ''),
(673, 'Hinduja Tech Limited CRP', 'Dear Student</br>\r\nWe have started registration for Hinduja Tech Limited.</br>\r\nIt has dual registration process i.e. Placement Portal and Company Link.</br>\r\nFor more information and Company registration <a href=\"https://docs.google.com/forms/d/e/1FAIpQLSf3fVLI6WIpfvaX1oSXAt4PDEILE0zkos-IYQ7KvyIWqCLVFw/viewform\" target=\"_blank\">Click here.</a>', '2018-06-13', '05:02:47', '152'),
(675, 'Resume Writing Training Session', 'Dear Student,</br>\r\nTraining and Placement Department has scheduled a Session on <b>Resume Writing</b> on Thursday, 14<sup>th</sup> June, 2018 at 10:00 AM.</br>\r\nAll of you have to present for the session at 09:45 AM sharp in formals at 7<sup>th</sup> Floor Auditorium.</br>\r\nRegistration and Attendance is mandatory.</br>\r\nCriteria: All Branches having CGPA less than 6.80</br>\r\n<strong>Deadline for Registration is till 13<sup>th</sup> June, 2018.</strong></br>', '2018-06-13', '05:37:13', '153'),
(676, 'Group Discussion Training Session', 'Dear Student,</br>\r\nTraining and Placement Department has scheduled a Session on <b>Group Discussion</b> on Thursday, 14<sup>th</sup> June, 2018 at 01:00 PM.</br>\r\nAll of you have to present for the session at 12:45 PM sharp in formals at 7<sup>th</sup> Floor Auditorium.</br>\r\nRegistration and Attendance is mandatory.</br>\r\nCriteria: All Branches having CGPA greater than or equal to 6.80</br>\r\n<strong>Deadline for Registration is till 13<sup>th</sup> June, 2018.</strong></br>', '2018-06-13', '05:40:59', '154'),
(677, 'Training Session Aptitude Test', 'Dear Student,</br>\r\nTraining and Placement Department has scheduled a Training Session and Mock Aptitude Test on Tuesday, 19<sup>th</sup> and 20<sup>th</sup> June 2018.</br>\r\nTraining Session on 19<sup>th</sup> June 2018 will start at 10:00 AM and Reporting Time is 09:45 AM.</br>\r\nMock Aptitude Test on 20<sup>th</sup> June 2018 will start at 10:30 AM and Reporting Time is 10:00 AM.</br>\r\nAll of you have to present in formals at 7<sup>th</sup> Floor Auditorium.</br>\r\nRegistration and Attendance is mandatory.</br>\r\nCriteria: All Branches having CGPA greater than or equal to 6.80</br>\r\nDeadline for Registration is till 17th June, 2018.</br>', '2018-06-14', '05:25:01', '155'),
(678, 'Training Session and Aptitude Test', 'Dear Student,</br>\r\nTraining and Placement Department has scheduled a Training Session and Mock Aptitude Test on 19<sup>th</sup> and 20<sup>th</sup> June 2018.</br>\r\nTraining Session on 19<sup>th</sup> June 2018 will start at 01:00 PM and Reporting Time is 12:45 PM.</br>\r\nMock Aptitude Test on 20<sup>th</sup> June 2018 will start at 12:00 PM and Reporting Time is 11:30 AM.</br>\r\nAll of you have to present in formals at 7<sup>th</sup> Floor Auditorium.</br>\r\nRegistration and Attendance is mandatory.</br>\r\nCriteria: All Branches having CGPA less than 6.80</br>\r\nDeadline for Registration is till 17th June, 2018.</br>', '2018-06-14', '05:28:27', '156'),
(679, 'EDUPRIME CRP ', 'Dear Students</br>\r\nWe have started the registration for Eduprime Technologies Pvt Ltd.</br>\r\nFor more details and Job Description refer the attachment.</br>\r\nDeadline for registration is 14<sup>th</sup> June 2018.</br>', '2018-06-14', '06:01:21', '157'),
(680, 'EDUPRIME CRP ', 'Dear Students</br>\r\nWe have started the registration for Eduprime Technologies Pvt Ltd.</br>\r\nFor more details and Job Description refer the attachment.</br>\r\nDeadline for registration is 14<sup>th</sup> June 2018.</br>', '2018-06-14', '06:03:40', '158'),
(681, 'Regarding Resume Submission', 'Dear Students,</br>\r\nKindly fill the Google Form</br>\r\n<a href=\"https://docs.google.com/forms/d/e/1FAIpQLSficoSDMyQbDfDlQ7bJ1WNggjRY2Vrc_WwwBRTOaYa0qolLeQ/viewform\" target=\"_blank\">Click here for Google Form Link.</a></br>', '2018-06-14', '06:15:01', ''),
(682, 'Diageo-RCS Technology', 'Dear Students,</br>\r\nwe have started the registration for Diageo-RCS Technology</br>\r\nit has two different registration i.e. placement portal and company google form</br>\r\nfor more details and company registration <a href=\"https://tinyurl.com/y9de9wy5\" target=\"_blank\">click here</a> </br>\r\nDeadline for both registration 18th June 2018 at  9:00 am</br>\r\nDetails Required:</br>\r\nTPO Name: Dr. Vinit Kotak</br>\r\nEmail ID: vinit_kotak@yahoo.com</br>\r\nNumber: +91-9322211207</br>\r\n', '2018-06-15', '01:36:08', '159'),
(683, 'Kotak Life Interview', 'Dear Students,</br> \r\nYour interview is scheduled for Kotak Life on Monday, 18<sup>th</sup>June 2018.</br>\r\nFor timing kindly refer attachments and reach before the scheduled timing.</br>\r\nCarry 3 hardcopies of the updated resume</br>\r\n<b>Process</b></br>\r\n1.       1st interview round </br>\r\n2.       2nd interview round for the candidates shortlisted after the 1st interview round</br>\r\n3.       Final Selection</br>\r\nVenue:</br>\r\nKotak Mahindra Bank Limited,</br>\r\n4th floor,Vinay Bhavya Complex</br>\r\n159-A, CST road, Kalina, Opp Nityanand hotel and Amar brass bus stop,</br>\r\nSantacruz, (E), Mumbai 400098</br>\r\nContact person: Maheshkumar  Pande (9892957713)</br>', '2018-06-16', '02:38:23', ''),
