(690, 'Eduprime CRP Process', 'Dear Student,</br>\r\nThe CRP Process for Eduprime is scheduled on Wednesday, 20<sup>th</sup>June, 2018.</br>\r\nThe Reporting time is 09:30 AM and venue is 4<sup>th</sup> floor auditorium.</br>\r\nKindly carry your complete Placement Kit along with you and be present in formals.</br>', '2018-06-18', '02:44:41', ''),
